(41170, 'end', '<C><F><I><N><Q>@end /end/<br />*  danh từ<br />- giới hạn<br />- đầu, đầu mút (dây...); đuôi; đáy (thùng...) đoạn cuối<br />- mẩu thừa, mẩu còn lại<br />=candle ends+ mẩu nến<br />- sự kết thúc<br />- sự kết liễu, sự chết<br />=to be near one''s end+ chẳng còn sống được bao lâu nữa, gần kề miệng lỗ<br />- kết quả<br />- mục đích<br />=to gain one''s ends+ đạt được mục đích của mình<br />!at one''s wit''s end<br />- (xem) wit<br />!to be at an end<br />!to come to an and<br />- hoàn thành<br />- bị kiệt quệ<br />!to be at the end of one''s tether<br />- (xem) tether<br />!end on<br />- với một đầu quay vào (ai)<br />!to go off the deep end<br />- (xem) deep<br />!in the end<br />- cuối cùng về sau<br />!to keep opne''s end up<br />- (xem) keep<br />!to make an end of<br />- chấm dứt<br />!to make both ends meet<br />- (xem) meet<br />!no end<br />- vô cùng<br />=no end obliged to you+ vô cùng cảm ơn anh<br />!no end of<br />- rất nhiều<br />=no end of trouble+ rất nhiều điều phiền nhiễu<br />- tuyệt diệu<br />=he is no end of a fellow+ nó là một thằng cha tuyệt diệu<br />!to end<br />- liền, liên tục<br />=for hours on end+ trong mấy tiếng liền<br />- thẳng đứng<br />!to place end to end<br />- đặt nối đàu vào nhau<br />!to put an end to<br />- chấm dứt, bãi bỏ<br />!to turn end for end<br />- lộn ngược lại, trở đầu lại, quay ngược lại<br />!world without end<br />- (xem) world<br />*  ngoại động từ<br />- kết thúc, chấm dứt<br />- kết liễu, diệt<br />*  nội động từ<br />- kết thúc, chấm dứt<br />- đi đến chỗ, đưa đến kết quả là<br />!to end up<br />- kết luận, kết thúc<br />!to end with<br />- kết thúc bằng<br />!to end by doing something<br />- cuối cùng sẽ làm việc gì<br />!to end in smoke<br />- (xem) smoke<br /><br />@end<br />- (Tech) cuối, đầu cuối; cuối màn hình; chấm dứt (đ)<br /><br />@end<br />- cuối cùng, kết thúc '),
