(41382, 'endow', '<C><F><I><N><Q>@endow /in''dau/<br />*  ngoại động từ<br />- cúng vốn cho (một tổ chức...)<br />- để vốn lại cho (vợ, con gái...)<br />- ((thường) động tính từ quá khứ) phú cho<br />=to be endowed with many talents+ được phú nhiều tài năng</Q></N></I></F></C>'),
(41383, 'endowed', '<C><F><I><N><Q>@endow /in''dau/<br />*  ngoại động từ<br />- cúng vốn cho (một tổ chức...)<br />- để vốn lại cho (vợ, con gái...)<br />- ((thường) động tính từ quá khứ) phú cho<br />=to be endowed with many talents+ được phú nhiều tài năng</Q></N></I></F></C>'),
(41384, 'endowing', '<C><F><I><N><Q>@endow /in''dau/<br />*  ngoại động từ<br />- cúng vốn cho (một tổ chức...)<br />- để vốn lại cho (vợ, con gái...)<br />- ((thường) động tính từ quá khứ) phú cho<br />=to be endowed with many talents+ được phú nhiều tài năng</Q></N></I></F></C>'),
(41385, 'endowment', '<C><F><I><N><Q>@endowment /in''daumənt/<br />*  danh từ<br />- sự cúng vốn cho (một tổ chức...); vốn cúng cho (một tổ chức...)<br />- sự để vốn lại (cho vợ, con gái...); vốn để lại (cho vợ, con gái...)<br />- tài năng, thiên tư<br />- (định ngữ) endowment insurance sự bảo hiểm có tiền thưởng trong lúc còn sống<br /><br />@endowment<br />- (toán kinh tế) niên bổng; tuế khí; món tiền gửi, tiền quyên giúp</Q></N></I></F></C>'),
(41386, 'Endowment effect', '<C><F><I><N><Q>@Endowment effect<br />- (Econ) Hiệu ứng hàng đã có.<br />+ Các cá nhân đòi hỏi nhiều hơn để có thể lôi kéo họ từ bỏ một hàng hoá mà họ đã có so với số tiền mà họ sẵn lòng trả để có được hàng hóa tương tự.</Q></N></I></F></C>'),
(41387, 'endowments', '<C><F><I><N><Q>@endowment /in''daumənt/<br />*  danh từ<br />- sự cúng vốn cho (một tổ chức...); vốn cúng cho (một tổ chức...)<br />- sự để vốn lại (cho vợ, con gái...); vốn để lại (cho vợ, con gái...)<br />- tài năng, thiên tư<br />- (định ngữ) endowment insurance sự bảo hiểm có tiền thưởng trong lúc còn sống<br /><br />@endowment<br />- (toán kinh tế) niên bổng; tuế khí; món tiền gửi, tiền quyên giúp</Q></N></I></F></C>'),
(41388, 'endows', '<C><F><I><N><Q>@endow /in''dau/<br />*  ngoại động từ<br />- cúng vốn cho (một tổ chức...)<br />- để vốn lại cho (vợ, con gái...)<br />- ((thường) động tính từ quá khứ) phú cho<br />=to be endowed with many talents+ được phú nhiều tài năng</Q></N></I></F></C>'),
(41389, 'endozoic', '<C><F><I><N><Q>@endozoic<br />* tính từ<br />- (sinh học) sống trong động vật</Q></N></I></F></C>'),
(41390, 'ends', '<C><F><I><N><Q>@end /end/<br />*  danh từ<br />- giới hạn<br />- đầu, đầu mút (dây...); đuôi; đáy (thùng...) đoạn cuối<br />- mẩu thừa, mẩu còn lại<br />=candle ends+ mẩu nến<br />- sự kết thúc<br />- sự kết liễu, sự chết<br />=to be near one''s end+ chẳng còn sống được bao lâu nữa, gần kề miệng lỗ<br />- kết quả<br />- mục đích<br />=to gain one''s ends+ đạt được mục đích của mình<br />!at one''s wit''s end<br />- (xem) wit<br />!to be at an end<br />!to come to an and<br />- hoàn thành<br />- bị kiệt quệ<br />!to be at the end of one''s tether<br />- (xem) tether<br />!end on<br />- với một đầu quay vào (ai)<br />!to go off the deep end<br />- (xem) deep<br />!in the end<br />- cuối cùng về sau<br />!to keep opne''s end up<br />- (xem) keep<br />!to make an end of<br />- chấm dứt<br />!to make both ends meet<br />- (xem) meet<br />!no end<br />- vô cùng<br />=no end obliged to you+ vô cùng cảm ơn anh<br />!no end of<br />- rất nhiều<br />=no end of trouble+ rất nhiều điều phiền nhiễu<br />- tuyệt diệu<br />=he is no end of a fellow+ nó là một thằng cha tuyệt diệu<br />!to end<br />- liền, liên tục<br />=for hours on end+ trong mấy tiếng liền<br />- thẳng đứng<br />!to place end to end<br />- đặt nối đàu vào nhau<br />!to put an end to<br />- chấm dứt, bãi bỏ<br />!to turn end for end<br />- lộn ngược lại, trở đầu lại, quay ngược lại<br />!world without end<br />- (xem) world<br />*  ngoại động từ<br />- kết thúc, chấm dứt<br />- kết liễu, diệt<br />*  nội động từ<br />- kết thúc, chấm dứt<br />- đi đến chỗ, đưa đến kết quả là<br />!to end up<br />- kết luận, kết thúc<br />!to end with<br />- kết thúc bằng<br />!to end by doing something<br />- cuối cùng sẽ làm việc gì<br />!to end in smoke<br />- (xem) smoke<br /><br />@end<br />- (Tech) cuối, đầu cuối; cuối màn hình; chấm dứt (đ)<br /><br />@end<br />- cuối cùng, kết thúc '),
(41391, 'endue', '<C><F><I><N><Q>@endue /in''dju:/ (indue) /in''dju:/<br />*  ngoại động từ<br />- mặc, khoác (áo...) ((nghĩa đen) &amp; (nghĩa bóng))<br />- ((thường) động tính từ quá khứ) cho, phú cho (ai) (đức tính)<br />=to be endued with many virtues+ có nhiều đức tính tốt</Q></N></I></F></C>'),
(41392, 'endurability', '<C><F><I><N><Q>@endurability<br />* danh từ<br />- tính chất có thể chịu đựng được<br />- tính chất bền</Q></N></I></F></C>'),
