(41399, 'enduring', '<C><F><I><N><Q>@enduring /in''djuəriɳ/<br />*  tính từ<br />- lâu dài, vĩnh viễn<br />- nhẫn nại, kiên trì; dai sức chịu đựng</Q></N></I></F></C><C><F><I><N><Q>@endure /in''djuə/<br />*  ngoại động từ<br />- chịu đựng, cam chịu, chịu được<br />*  nội động từ<br />- kéo dài, tồn tại</Q></N></I></F></C>'),
