(41402, 'endways', '<C><F><I><N><Q>@endways<br />* phó từ<br />- đầu dựng ngược<br />- đầu quay về phía người nhìn, đầu đưa ra đằng trước<br />- châu đầu vào nhauhau</Q></N></I></F></C>'),
(41403, 'endwaysa', '<C><F><I><N><Q>@endwaysa /''endweiz/ (endwise) /''endwaiz/<br />*  phó từ<br />- đầu dựng ngược<br />- đầu quay về phía người nhìn, đầu đưa ra đằng trước<br />- châu đầu vào nhau</Q></N></I></F></C>'),
(41404, 'endwise', '<C><F><I><N><Q>@endwise /''endweiz/ (endwise) /''endwaiz/<br />*  phó từ<br />- đầu dựng ngược<br />- đầu quay về phía người nhìn, đầu đưa ra đằng trước<br />- châu đầu vào nhau</Q></N></I></F></C>'),
