(41407, 'enemata', '<C><F><I><N><Q>@enema /''enimə/<br />*  danh từ<br />- (y học) sự thụt<br />- dụng cụ thụt</Q></N></I></F></C>'),
(41408, 'enemies', '<C><F><I><N><Q>@enemy /''enimi/<br />*  danh từ<br />- kẻ thù, kẻ địch, địch thủ; quân địch, tàu địch<br />=to be one''s own enemy+ tự mình làm hại mình<br />- (thông tục) thì giờ<br />=how goes the enemy?+ mấy giờ rồi?<br />=to kill the enemy+ giết thì giờ<br />!the Enemy<br />- ma vương<br />*  tính từ<br />- của địch, thù địch</Q></N></I></F></C>'),
(41409, 'enemy', '<C><F><I><N><Q>@enemy /''enimi/<br />*  danh từ<br />- kẻ thù, kẻ địch, địch thủ; quân địch, tàu địch<br />=to be one''s own enemy+ tự mình làm hại mình<br />- (thông tục) thì giờ<br />=how goes the enemy?+ mấy giờ rồi?<br />=to kill the enemy+ giết thì giờ<br />!the Enemy<br />- ma vương<br />*  tính từ<br />- của địch, thù địch</Q></N></I></F></C>'),
(41410, 'energesis', '<C><F><I><N><Q>@energesis<br />* danh từ<br />- quá trình dị hoá giải phóng năng lượng; quá trình dị hoá thải nhiệt</Q></N></I></F></C>'),
(41411, 'energetic', '<C><F><I><N><Q>@energetic /,enə''dʤetik/<br />*  tính từ<br />- mạnh mẽ, mãnh liệt, đầy nghị lực, đầy sinh lực; hoạt động</Q></N></I></F></C>'),
