(41413, 'energetics', '<C><F><I><N><Q>@energetics /,enə''dʤetiks/<br />*  danh từ,  số nhiều dùng như số ít<br />- năng lượng học</Q></N></I></F></C>'),
(41414, 'energic', '<C><F><I><N><Q>@energic /i''nə:dʤik/<br />*  tính từ<br />- (từ hiếm,nghĩa hiếm) (như) energetic</Q></N></I></F></C>'),
(41415, 'energid', '<C><F><I><N><Q>@energid<br />* danh từ<br />- (sinh học) thể nguyên sinh; chất nguyên sinh hoạt động</Q></N></I></F></C>'),
(41416, 'energids', '<C><F><I><N><Q>@energid<br />* danh từ<br />- (sinh học) thể nguyên sinh; chất nguyên sinh hoạt động</Q></N></I></F></C>'),
(41417, 'energies', '<C><F><I><N><Q>@energy /''enədʤi/<br />*  danh từ<br />- nghị lực, sinh lực<br />- sự hoạt động tích cực<br />- khả năng tiềm tàng, năng lực tiềm tàng<br />- (số nhiều) sức lực<br />- (vật lý) năng lượng<br />=solar energy+ năng lượng mặt trời<br />=kinetic energy+ động năng<br /><br />@energy<br />- (Tech) năng lượng<br /><br />@energy<br />- năng lượng<br />- e. of deformation năng lượng biến dạng<br />- binding e. (vật lí) năng lượng liên kết<br />- complementary e. năng lượng bù<br />- electrostatic e. tĩnh điện năng<br />- excitation e. năng lượng kích thích<br />- intrinsic e. năng lượng tự tại, nội năng <br />- kinetic e. động năng<br />- minimum potential e. thế năng cực tiểu<br />- potential e. (vật lí) thế năng<br />- potential e. of bending thế năng uốn<br />- potential e. of strain thế năng biến dạng<br />- surface e. năng lượng mặt<br />- total e. năng lượng toàn phần</Q></N></I></F></C>'),
(41418, 'energise', '<C><F><I><N><Q>@energise /''enədʤaiz/ (energize) /''enədʤaiz/<br />*  ngoại động từ<br />- làm mạnh mẽ, làm mãnh liệt, tiếp nghị lực cho, tiếp sinh lực cho<br />*  nội động từ<br />- hoạt động mạnh mẽ</Q></N></I></F></C>'),
