(41472, 'enforcing', '<C><F><I><N><Q>@enforce /in''fɔ:s/<br />*  ngoại động từ<br />- làm cho có hiệu lực, làm cho có sức mạnh (một lý lẽ), đòi cho được (một yêu sách)<br />- (+ upon) ép làm, thúc ép, ép buộc (một việc gì)<br />=to enforce something upon someone+ ép ai phải làm một việc gì<br />- bắt tôn trọng, bắt tuân theo; đem thi hành (luật lệ)</Q></N></I></F></C>'),
