(41474, 'enfranchise', '<C><F><I><N><Q>@enfranchise /in''fræntʃaiz/<br />*  ngoại động từ<br />- giải phóng, cho tự do<br />- ban quyền (được cử nghị viên... cho một thành phố)<br />- cho được quyền bầu cử</Q></N></I></F></C>'),
(41475, 'enfranchised', '<C><F><I><N><Q>@enfranchise /in''fræntʃaiz/<br />*  ngoại động từ<br />- giải phóng, cho tự do<br />- ban quyền (được cử nghị viên... cho một thành phố)<br />- cho được quyền bầu cử</Q></N></I></F></C>'),
(41476, 'enfranchisement', '<C><F><I><N><Q>@enfranchisement /in''fræntʃizmənt/<br />*  danh từ<br />- sự giải phóng, sự cho tự do<br />- sự ban quyền (được cử nghị viên... cho một thành phố)<br />- sự cho được quyền bầu cử</Q></N></I></F></C>'),
(41477, 'Enfranchisement of the nomenklatura', '<C><F><I><N><Q>@Enfranchisement of the nomenklatura<br />- (Econ) Đặc quyền của giới chức.<br />+ Một cách tiếp cận không chính thức và không rõ ràng đối với quá trình TƯ NHÂN HOÁ nhanh chóng tài sản nhà nước ở các nước xã hội chủ nghĩa trước đây (và một vài nước khác), qua đó các nhà hoạt động đảng phái trước đây và quan chức nhà nước có thể mua tài sản nhà nước với giá thấp hơn giá thị trường. Thuật ngữ nomenklatura chỉ những người được lựa chọn vào các chức vụ cao, nhưng không phải do công trạng mà do sự phán quyết của đảng cầm quyền.</Q></N></I></F></C>'),
(41478, 'enfranchisements', '<C><F><I><N><Q>@enfranchisement /in''fræntʃizmənt/<br />*  danh từ<br />- sự giải phóng, sự cho tự do<br />- sự ban quyền (được cử nghị viên... cho một thành phố)<br />- sự cho được quyền bầu cử</Q></N></I></F></C>'),
(41479, 'enfranchises', '<C><F><I><N><Q>@enfranchise /in''fræntʃaiz/<br />*  ngoại động từ<br />- giải phóng, cho tự do<br />- ban quyền (được cử nghị viên... cho một thành phố)<br />- cho được quyền bầu cử</Q></N></I></F></C>'),
(41480, 'enfranchising', '<C><F><I><N><Q>@enfranchise /in''fræntʃaiz/<br />*  ngoại động từ<br />- giải phóng, cho tự do<br />- ban quyền (được cử nghị viên... cho một thành phố)<br />- cho được quyền bầu cử</Q></N></I></F></C>'),
(41481, 'eng', '<C><F><I><N><Q>@eng<br />* (viết tắt)<br />= engineer (ing)+Peter BSc (Eng)<br />- Peter, cử nhân khoa học (kỹ sư)<br />- nước Anh (England)<br />- người Anh; tiếng Anh (English)<br />- viết tắt<br />= engineer (ing)+Peter BSc (Eng)<br />- Peter, cử nhân khoa học (kỹ sư)<br />- nước Anh (England)<br />- người Anh; tiếng Anh (English)</Q></N></I></F></C>'),
(41482, 'engage', '<C><F><I><N><Q>@engage /in''geidʤ/<br />*  ngoại động từ<br />- hẹn, hứa hẹn, ước hẹn, cam kết; đính ước, hứa hôn<br />=to engage oneself to do something+ hứa hẹn làm gì<br />=to become engaged to+ hứa hôn với<br />- thuê (người ở); giữ trước (chỗ ngồi...)<br />- lấy (danh dự...) mà cam kết<br />- thu hút (sự chú ý...); giành được (tình cảm...); làm cho mát mẻ<br />- ((thường) động tính từ quá khứ) mắc bận<br />=to be engaged in something+ bận làm việc gì<br />- (quân sự) giao chiến, đánh nhau với<br />=to engage the enemy in heavy fighting+ đánh nhau với quân địch rất dữ dội<br />- (kỹ thuật) gài (số...)<br />- (kiến trúc) gắn vào tường; ghép (vật nọ với vật kia)<br />*  nội động từ<br />- (+ in) làm, tiến hành<br />=to engage in politics+ làm chính trị<br />=to engage in business+ kinh doanh<br />=to engage in negotiations with someone+ tiến hành thương lượng với ai<br />- (kỹ thuật) (+ with) gài, khớp (với)</Q></N></I></F></C>'),
(41483, 'engaged', '<C><F><I><N><Q>@engaged /in''geidʤd/<br />*  tính từ<br />- đã đính ước, đã hứa hôn<br />- được giữ trước, có người rồi (xe, chỗ ngồi...)<br />- mắc bận, bận rộn<br />- đang giao chiến, đang đánh nhau (quân lính)</Q></N></I></F></C><C><F><I><N><Q>@engage /in''geidʤ/<br />*  ngoại động từ<br />- hẹn, hứa hẹn, ước hẹn, cam kết; đính ước, hứa hôn<br />=to engage oneself to do something+ hứa hẹn làm gì<br />=to become engaged to+ hứa hôn với<br />- thuê (người ở); giữ trước (chỗ ngồi...)<br />- lấy (danh dự...) mà cam kết<br />- thu hút (sự chú ý...); giành được (tình cảm...); làm cho mát mẻ<br />- ((thường) động tính từ quá khứ) mắc bận<br />=to be engaged in something+ bận làm việc gì<br />- (quân sự) giao chiến, đánh nhau với<br />=to engage the enemy in heavy fighting+ đánh nhau với quân địch rất dữ dội<br />- (kỹ thuật) gài (số...)<br />- (kiến trúc) gắn vào tường; ghép (vật nọ với vật kia)<br />*  nội động từ<br />- (+ in) làm, tiến hành<br />=to engage in politics+ làm chính trị<br />=to engage in business+ kinh doanh<br />=to engage in negotiations with someone+ tiến hành thương lượng với ai<br />- (kỹ thuật) (+ with) gài, khớp (với)</Q></N></I></F></C>'),
(41484, 'engagement', '<C><F><I><N><Q>@engagement /in''geidʤmənt/<br />*  danh từ<br />- sự hứa hẹn, sự ước hẹn, sự cam kết, sự ràng buộc, sự hứa hôn<br />=to keep one''s engagements+ tôn trọng những lời cam kết của mình<br />- sự hứa gặp<br />=a public engagement+ sự hứa nói chuyện với công chúng<br />=social engagements+ sự được mời mọc ở các cuộc chiêu đãi...<br />- sự thuê mướn (người làm...), sự tuyển mộ<br />- công việc làm (của người thư ký, người giúp việc...)<br />- (kỹ thuật) sự gài (số...)<br />- (quân sự) sự giao chiến; cuộc đánh nhau</Q></N></I></F></C>'),
(41485, 'engagement ring', '<C><F><I><N><Q>@engagement ring<br />* danh từ<br />- nhẫn đính hôn</Q></N></I></F></C>'),
(41486, 'Engagements', '<C><F><I><N><Q>@Engagements<br />- (Econ) Tuyển dụng (hay thuê mới).<br />+ Tổng số người tham gia đội ngũ có việc là trong bất cứ thời kỳ nào.</Q></N></I></F></C>'),
(41487, 'engagements', '<C><F><I><N><Q>@engagement /in''geidʤmənt/<br />*  danh từ<br />- sự hứa hẹn, sự ước hẹn, sự cam kết, sự ràng buộc, sự hứa hôn<br />=to keep one''s engagements+ tôn trọng những lời cam kết của mình<br />- sự hứa gặp<br />=a public engagement+ sự hứa nói chuyện với công chúng<br />=social engagements+ sự được mời mọc ở các cuộc chiêu đãi...<br />- sự thuê mướn (người làm...), sự tuyển mộ<br />- công việc làm (của người thư ký, người giúp việc...)<br />- (kỹ thuật) sự gài (số...)<br />- (quân sự) sự giao chiến; cuộc đánh nhau</Q></N></I></F></C>'),
(41488, 'engager', '<C><F><I><N><Q>@engager<br />- xem engage</Q></N></I></F></C>'),
(41489, 'engages', '<C><F><I><N><Q>@engage /in''geidʤ/<br />*  ngoại động từ<br />- hẹn, hứa hẹn, ước hẹn, cam kết; đính ước, hứa hôn<br />=to engage oneself to do something+ hứa hẹn làm gì<br />=to become engaged to+ hứa hôn với<br />- thuê (người ở); giữ trước (chỗ ngồi...)<br />- lấy (danh dự...) mà cam kết<br />- thu hút (sự chú ý...); giành được (tình cảm...); làm cho mát mẻ<br />- ((thường) động tính từ quá khứ) mắc bận<br />=to be engaged in something+ bận làm việc gì<br />- (quân sự) giao chiến, đánh nhau với<br />=to engage the enemy in heavy fighting+ đánh nhau với quân địch rất dữ dội<br />- (kỹ thuật) gài (số...)<br />- (kiến trúc) gắn vào tường; ghép (vật nọ với vật kia)<br />*  nội động từ<br />- (+ in) làm, tiến hành<br />=to engage in politics+ làm chính trị<br />=to engage in business+ kinh doanh<br />=to engage in negotiations with someone+ tiến hành thương lượng với ai<br />- (kỹ thuật) (+ with) gài, khớp (với)</Q></N></I></F></C>'),
(41490, 'engaging', '<C><F><I><N><Q>@engaging /in''geidʤiɳ/<br />*  tính từ<br />- lôi kéo, hấp dẫn; duyên dáng (nụ cười, giọng nói, cái nhìn...)</Q></N></I></F></C><C><F><I><N><Q>@engage /in''geidʤ/<br />*  ngoại động từ<br />- hẹn, hứa hẹn, ước hẹn, cam kết; đính ước, hứa hôn<br />=to engage oneself to do something+ hứa hẹn làm gì<br />=to become engaged to+ hứa hôn với<br />- thuê (người ở); giữ trước (chỗ ngồi...)<br />- lấy (danh dự...) mà cam kết<br />- thu hút (sự chú ý...); giành được (tình cảm...); làm cho mát mẻ<br />- ((thường) động tính từ quá khứ) mắc bận<br />=to be engaged in something+ bận làm việc gì<br />- (quân sự) giao chiến, đánh nhau với<br />=to engage the enemy in heavy fighting+ đánh nhau với quân địch rất dữ dội<br />- (kỹ thuật) gài (số...)<br />- (kiến trúc) gắn vào tường; ghép (vật nọ với vật kia)<br />*  nội động từ<br />- (+ in) làm, tiến hành<br />=to engage in politics+ làm chính trị<br />=to engage in business+ kinh doanh<br />=to engage in negotiations with someone+ tiến hành thương lượng với ai<br />- (kỹ thuật) (+ with) gài, khớp (với)</Q></N></I></F></C>'),
(41491, 'engagingly', '<C><F><I><N><Q>@engagingly<br />* phó từ<br />- hấp dẫn, thú vị</Q></N></I></F></C>'),
(41492, 'engarland', '<C><F><I><N><Q>@engarland /in''gɑ:lənd/<br />*  ngoại động từ<br />- khoác vòng hoa cho (ai); đặt vòng hoa vào đầu (ai)<br />=to engarland someone with flowers+ đặt vòng hoa vào đầu ai</Q></N></I></F></C>'),
(41493, 'Engel curve', '<C><F><I><N><Q>@Engel curve<br />- (Econ) Đường Engel.<br />+ Một đường biểu thị mối quan hệ giữa thu nhập và tiêu dùng của một cá nhân về một hàng hoá cụ thể.</Q></N></I></F></C>'),
(41494, 'Engel''s Law', '<C><F><I><N><Q>@Engel''s Law<br />- (Econ) Quy luật của Engel.<br />+ Một quy luật tiêu dùng thực nghiệm do Ernst Engel đề xướng.Ý tưởng ở đây là phần thu nhập quốc gia được chi tiêu cho lương thực là một chỉ số tốt về phúc lợi của quốc gia đó.</Q></N></I></F></C>'),
(41495, 'engender', '<C><F><I><N><Q>@engender /in''dʤendə/<br />*  ngoại động từ<br />- sinh ra, gây ra, đem lại<br />- (từ hiếm,nghĩa hiếm) đẻ ra, sinh ra</Q></N></I></F></C>'),
(41496, 'engendered', '<C><F><I><N><Q>@engender /in''dʤendə/<br />*  ngoại động từ<br />- sinh ra, gây ra, đem lại<br />- (từ hiếm,nghĩa hiếm) đẻ ra, sinh ra</Q></N></I></F></C>'),
(41497, 'engenderer', '<C><F><I><N><Q>@engenderer<br />- xem engender</Q></N></I></F></C>'),
(41498, 'engendering', '<C><F><I><N><Q>@engender /in''dʤendə/<br />*  ngoại động từ<br />- sinh ra, gây ra, đem lại<br />- (từ hiếm,nghĩa hiếm) đẻ ra, sinh ra</Q></N></I></F></C>'),
(41499, 'engenders', '<C><F><I><N><Q>@engender /in''dʤendə/<br />*  ngoại động từ<br />- sinh ra, gây ra, đem lại<br />- (từ hiếm,nghĩa hiếm) đẻ ra, sinh ra</Q></N></I></F></C>'),
(41500, 'engild', '<C><F><I><N><Q>@engild<br />* ngoại động từ<br />- mạ vàng</Q></N></I></F></C>'),
(41501, 'engine', '<C><F><I><N><Q>@engine /''endʤin/<br />*  danh từ<br />- máy động cơ<br />- đầu máy (xe lửa)<br />- dụng cụ chiến tranh<br />=engines of war+ dụng cụ chiến tranh<br />- dụng cụ, phương tiện<br />=to use every available engine to gain one''s end+ sử dụng mọi phương tiện sẵn có để đạt mục đích của mình<br />*  ngoại động từ<br />- lắp máy vào (thu...); gắn động cơ vào<br /><br />@engine<br />- máy, môtơ, động cơ, cơ cấu, dụng cụ<br />- explosion e. động cơ đốt trong, máy nổ<br />- jet e. động có phản lực</Q></N></I></F></C>'),
(41502, 'engine-driven', '<C><F><I><N><Q>@engine-driven /''endʤun,drivn/<br />*  tính từ<br />- (kỹ thuật) chạy bằng máy, chạy bằng động cơ</Q></N></I></F></C>'),
(41503, 'engine-driver', '<C><F><I><N><Q>@engine-driver /''endʤin,draivə/<br />*  danh từ<br />- thợ máy<br />- người lái đầu máy xe lửa</Q></N></I></F></C>'),
(41504, 'engine-house', '<C><F><I><N><Q>@engine-house<br />* danh từ<br />- trạm cứu hoả</Q></N></I></F></C>'),
(41505, 'engine-lathe', '<C><F><I><N><Q>@engine-lathe /''endʤinleið/<br />*  danh từ<br />- (kỹ thuật) máy tiện</Q></N></I></F></C>'),
(41506, 'engine-plant', '<C><F><I><N><Q>@engine-plant /''endʤinplɑ:nt/<br />*  danh từ<br />- sự lắp máy<br />- nhà máy chế tạo đầu máy xe lửa</Q></N></I></F></C>'),
(41507, 'engine-shed', '<C><F><I><N><Q>@engine-shed<br />* danh từ<br />- nhà để đầu máy xe lửa</Q></N></I></F></C>'),
(41508, 'engine switch', '<C><F><I><N><Q>@engine switch<br />- (Tech) công tắc máy</Q></N></I></F></C>'),
(41509, 'engine-trouble', '<C><F><I><N><Q>@engine-trouble /''endʤin,trʌbl/<br />*  danh từ<br />- sự hỏng máy, sự liệt máy (ô tô)</Q></N></I></F></C>'),
(41510, 'engine-turn', '<C><F><I><N><Q>@engine-turn<br />* ngoại động từ<br />- chạm đường lộng chéo</Q></N></I></F></C>'),
(41511, 'engined', '<C><F><I><N><Q>@engined<br />* tính từ<br />- có lắp máy<br />= front -engined car+ôtô lắp máy phía trước</Q></N></I></F></C>'),
(41512, 'engineer', '<C><F><I><N><Q>@engineer /,endʤi''niə/<br />*  danh từ<br />- kỹ sư, công trình sư<br />- kỹ sư xây dựng ((cũng) civil engineer)<br />- công binh; người thiết kế và xây dựng công sự<br />- người phụ trách máy; (từ Mỹ,nghĩa Mỹ) người lái đầu máy xe lửa<br />- (thông tục) người nghĩ ra, người bày ra, người vạch ra, người bố trí (mưu kế...)<br />*  ngoại động từ<br />- nghĩ ra, bày ra, vạch ra, bố trí, sắp đặt (mưu kế...)<br />*  nội động từ<br />- làm kỹ sư, làm công trình sư<br /><br />@engineer<br />- (Tech) kỹ sư<br /><br />@engineer<br />- kỹ sư</Q></N></I></F></C>'),
(41513, 'engineered', '<C><F><I><N><Q>@engineer /,endʤi''niə/<br />*  danh từ<br />- kỹ sư, công trình sư<br />- kỹ sư xây dựng ((cũng) civil engineer)<br />- công binh; người thiết kế và xây dựng công sự<br />- người phụ trách máy; (từ Mỹ,nghĩa Mỹ) người lái đầu máy xe lửa<br />- (thông tục) người nghĩ ra, người bày ra, người vạch ra, người bố trí (mưu kế...)<br />*  ngoại động từ<br />- nghĩ ra, bày ra, vạch ra, bố trí, sắp đặt (mưu kế...)<br />*  nội động từ<br />- làm kỹ sư, làm công trình sư<br /><br />@engineer<br />- (Tech) kỹ sư<br /><br />@engineer<br />- kỹ sư</Q></N></I></F></C>'),
(41514, 'engineering', '<C><F><I><N><Q>@engineering /,endʤi''niəriɳ/<br />*  danh từ<br />- kỹ thuật kỹ sư, kỹ thuật công trình sư; nghề kỹ sư, nghề công trình sư<br />- kỹ thuật xấy dựng ((cũng) civil engineerings)<br />=military engineering+ kỹ thuật công binh<br />- (số nhiều) ruốm khứ mánh khoé<br /><br />@engineering<br />- (Tech) ngành kỹ thuật, công trình học; công trình; ngành kỹ thuật thiết kế và quản lý; công nghệ<br /><br />@engineering<br />- kỹ thuật<br />- civil e. ngành xây dựng<br />- communication e. kỹ thuật thông tin<br />- control e. kỹ thuật [điều chỉnh, điều khiển] (tự động)<br />- development e. nghiên cứu những kết cấu mới<br />- electrical e. điện kỹ thuật<br />- electronics e. điện tử học<br />- heavy current e. kỹ thuật các dòng (điện) mạch <br />- human e. tâm lý học kỹ thuật<br />- hydraulic e. kỹ thuật thuỷ lợi<br />- light-current e. kỹ thuật các dòng (điện) yếu<br />- mechanical e. kỹ thuật cơ khí, chế tạo máy<br />- military e. kỹ thuật quân sự<br />- power e. năng lượng học<br />- process e. kỹ thuật<br />- radio e. kỹ thuật vô tuyến<br />- reseach e. nghiên cứu kỹ thuật<br />- system e. kế hoạch hoá hệ thống, kỹ thuật hệ thống</Q></N></I></F></C><C><F><I><N><Q>@engineer /,endʤi''niə/<br />*  danh từ<br />- kỹ sư, công trình sư<br />- kỹ sư xây dựng ((cũng) civil engineer)<br />- công binh; người thiết kế và xây dựng công sự<br />- người phụ trách máy; (từ Mỹ,nghĩa Mỹ) người lái đầu máy xe lửa<br />- (thông tục) người nghĩ ra, người bày ra, người vạch ra, người bố trí (mưu kế...)<br />*  ngoại động từ<br />- nghĩ ra, bày ra, vạch ra, bố trí, sắp đặt (mưu kế...)<br />*  nội động từ<br />- làm kỹ sư, làm công trình sư<br /><br />@engineer<br />- (Tech) kỹ sư<br /><br />@engineer<br />- kỹ sư</Q></N></I></F></C>'),
(41515, 'engineering board', '<C><F><I><N><Q>@engineering board<br />- (Tech) bảng công trình, ủy ban quản lí công trình</Q></N></I></F></C>'),
(41516, 'engineering cybernetics', '<C><F><I><N><Q>@engineering cybernetics<br />- (Tech) kỹ thuật điều khiển, kỹ thuật xibecnêtic</Q></N></I></F></C>'),
(41517, 'Engineering method', '<C><F><I><N><Q>@Engineering method<br />- (Econ) Phương pháp kỹ thuật.<br />+ Một phương pháp được dùng trong PHÂN TÍCH CHI PHÍ THÔNG KÊ, trong đó những ước tính của người kỹ sư về mối liên hệ đầu vào- đầu ra là cơ sở để tính toán chi phí sản xuất tối thiểu tại các mức sản lượng khác nhau.</Q></N></I></F></C>'),
(41518, 'engineering reliability', '<C><F><I><N><Q>@engineering reliability<br />- (Tech) độ tin cậy kỹ thuật</Q></N></I></F></C>'),
(41519, 'engineering unit', '<C><F><I><N><Q>@engineering unit<br />- (Tech) đơn vị kỹ thuật</Q></N></I></F></C>'),
