(41836, 'enter', '<C><F><I><N><Q>@enter /''entə/<br />*  nội động từ<br />- đi vào<br />- (sân khấu) ra<br />- tuyên bố tham dự (cuộc thi)<br />*  ngoại động từ<br />- đi vào (một nơi nào...); đâm (vào thịt...)<br />- gia nhập (quân đội...)<br />- bắt đầu luyện (chó ngựa)<br />- ghi (tên vào sổ, cuộc thi...)<br />- kết nạp, lấy vào<br />!to enter into<br />- đi vào (nơi nào)<br />- tiến hành (cuộc nói chuyện, cuộc điều tra); thiết lập (quan hệ...); ký kết (hiệp nghị...)<br />- thông cảm với (ý nghĩ, tình cảm của ai)<br />- tự ràng buộc mình vào, tham dự (hợp đồng, hiệp ước...)<br />- nằm trong (kế hoạch, sự tính toán)<br />!to enter on (upon)<br />- bắt đầu (một quá trình gì...); bắt đầu bàn về (một vấn đề...)<br />- (pháp lý) tiếp nhận, tiếp thu (tài sản)<br />!to enter an appearance<br />- có ý đến dự (cuộc họp...); nhất định có mặt (ở cuộc mít tinh...)<br />!to enter a protest<br />- phản kháng; đề nghị ghi lời phản kháng của mình (vào văn bản...)<br />!to enter up account books<br />- kết toán sổ sách<br /><br />@enter<br />- (Tech) cho vào<br /><br />@enter<br />- vào, ghi, ra nhập</Q></N></I></F></C>'),
