(42153, 'Environmental determinism', '<C><F><I><N><Q>@Environmental determinism<br />- (Econ) Quyết định luận do môi trường.<br />+ Giả thuyết cho rằng môi trường vật chất là yếu tố chính quyết định tới trình độ phát triển kinh tế của một quốc gia.</Q></N></I></F></C>'),
(42154, 'Environmental impact analysis', '<C><F><I><N><Q>@Environmental impact analysis<br />- (Econ) Phân tích tác động môi trường.<br />+ Một phân tích tìm cách xác định rõ ràng những ảnh hưởng lên toàn bộ môi trường của một dự án đầu tư.</Q></N></I></F></C>'),
