(42599, 'Equal advantage', '<C><F><I><N><Q>@Equal advantage<br />- (Econ) Lợi thế bình đẳng, Lợi thế ngang bằng.<br />+ Xem COMPARATIVE ADVANTAGE.</Q></N></I></F></C>'),
(42600, 'Equal Employment Opportunity Act of Dao luat ve co hoi viec lam', '<C><F><I><N><Q>@Equal Employment Opportunity Act of Đạo luật về cơ hội việc làm /bình đẳng/ngang bằng năm 1972.<br />- (Econ) Một đạo luật mở rộng vi phạm của mục VII của Đạo luật Quyền dân sự của Mỹ năm 1964 sang các chính quyền tiểu bang và địa phương và cho phép Uỷ ban cơ hội việc làm ngang nhau lập hồ sơ kiện tụng cho bản thân họ.</Q></N></I></F></C>'),
(42601, 'Equal Employment Opportunity Act of Đạo luật về cơ hội việc làm', '<C><F><I><N><Q>@Equal Employment Opportunity Act of Đạo luật về cơ hội việc làm /bình đẳng/ngang bằng năm 1972.<br />- (Econ) Một đạo luật mở rộng vi phạm của mục VII của Đạo luật Quyền dân sự của Mỹ năm 1964 sang các chính quyền tiểu bang và địa phương và cho phép Uỷ ban cơ hội việc làm ngang nhau lập hồ sơ kiện tụng cho bản thân họ.</Q></N></I></F></C>'),
(42602, 'Equal Employment Opportunity Commision', '<C><F><I><N><Q>@Equal Employment Opportunity Commision<br />- (Econ) Uỷ ban Cơ hội việc làm bình đẳng/ngang bằng.<br />+ Một uỷ ban được thành lập để giải quyết những khiếu nại bắt nguồn từ sự thông qua Đạo luật Quyền dân sự của Mỹ năm 1964. Đạo luật này nghiêm cấm hành động phân biệt đối xử của các ông chủ.</Q></N></I></F></C>'),
(42603, 'Equal pay', '<C><F><I><N><Q>@Equal pay<br />- (Econ) Trả lương ngang nhau; trả lương  bình đẳng.<br />+ Sự công bằng giữa các giới về điều khoản và điều kiện việc làm: một khái niệm về trả lương ngang nhau cho công việc có giá trị ngang nhau, mặc dù định nghĩa về trả lương và công việc ngang nhau không giống nhau giữa các nước.</Q></N></I></F></C>'),
(42604, 'Equal sacrifice theories', '<C><F><I><N><Q>@Equal sacrifice theories<br />- (Econ) Lý thuyết hy sinh ngang nhau; lý thuyết hy sinh bình đẳng.<br />+ Sự hy sinh cùng ĐỘ THOẢ DỤNG của những người trả thuế.</Q></N></I></F></C>'),
