(42678, 'equilibrates', '<C><F><I><N><Q>@equilibrate /,i:kwi''laibreit/<br />*  ngoại động từ<br />- làm cân bằng<br />- cân bằng<br />*  nội động từ<br />- cân bằng<br />- làm đối trọng cho nhau<br /><br />@equilibrate<br />- làm cân bằng</Q></N></I></F></C>'),
(42679, 'equilibrating', '<C><F><I><N><Q>@equilibrate /,i:kwi''laibreit/<br />*  ngoại động từ<br />- làm cân bằng<br />- cân bằng<br />*  nội động từ<br />- cân bằng<br />- làm đối trọng cho nhau<br /><br />@equilibrate<br />- làm cân bằng</Q></N></I></F></C>'),
(42680, 'equilibration', '<C><F><I><N><Q>@equilibration /,i:kwilai''breiʃn/<br />*  danh từ<br />- sự làm cân bằng<br />- sự cân bằng<br />- sự làm đối trọng cho nhau<br /><br />@equilibration<br />- sự cân bằng</Q></N></I></F></C>'),
(42681, 'equilibratory', '<C><F><I><N><Q>@equilibratory /,i:kwi''laibrətəri/<br />*  tính từ<br />- để làm đối trọng</Q></N></I></F></C>'),
(42682, 'equilibria', '<C><F><I><N><Q>@Equilibrium<br />- (Econ) Cân bằng<br />+ Một cụm thuật ngữ mượn từ môn vật lý để miêu tả tình huống, trong đó các tác nhân kinh tế hay tổng tác nhân kinh tế như thị trường, không có động lực gì để thay đổi hành vi kinh tế của mình.</Q></N></I></F></C><C><F><I><N><Q>@equilibrium /,i:kwi''libriəm /<br />*  danh từ<br />- sự thăng bằng<br />- tính vô tư (trong nhận xét...)<br /><br />@equilibrium<br />- (Tech) cân bằng<br /><br />@equilibrium<br />- sự cân bằng<br />- e. of forces sự cân bằng lực<br />- e. of a particle [of a body] sự cân bằng của một vật thể<br />- configuration e. cấu hình thăng bằng<br />- dynamic e. cân bằng động lực<br />- elastic e. cân bằng đàn hồi<br />- indifferent e. cân bằng không phân biệt<br />- labile e. (vật lí) cân bằng không ổn định<br />- mobile e. (điều khiển học) cân bằng di động<br />- neutral e. (cơ học) cân bằng không phân biệt<br />- phase e. (vật lí) cân bằng pha<br />- plastic e. cân bằng dẻo<br />- relative e. cân bằng tương đối<br />- semi-stable e. cân bằng nửa ổn định<br />- stable e. cân bằng ổn định<br />- trasient e. (điều khiển học) cân bằng động<br />- unstable e. (vật lí) cân bằng không ổn định</Q></N></I></F></C>'),
(42683, 'equilibrist', '<C><F><I><N><Q>@equilibrist /,i:kwilibrist/<br />*  danh từ<br />- người làm xiếc trên dây</Q></N></I></F></C>'),
(42684, 'equilibristic', '<C><F><I><N><Q>@equilibristic<br />- xem equilibrist</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(42685, 'Equilibrium', '<C><F><I><N><Q>@Equilibrium<br />- (Econ) Cân bằng<br />+ Một cụm thuật ngữ mượn từ môn vật lý để miêu tả tình huống, trong đó các tác nhân kinh tế hay tổng tác nhân kinh tế như thị trường, không có động lực gì để thay đổi hành vi kinh tế của mình.</Q></N></I></F></C>'),
(42686, 'equilibrium', '<C><F><I><N><Q>@equilibrium /,i:kwi''libriəm /<br />*  danh từ<br />- sự thăng bằng<br />- tính vô tư (trong nhận xét...)<br /><br />@equilibrium<br />- (Tech) cân bằng<br /><br />@equilibrium<br />- sự cân bằng<br />- e. of forces sự cân bằng lực<br />- e. of a particle [of a body] sự cân bằng của một vật thể<br />- configuration e. cấu hình thăng bằng<br />- dynamic e. cân bằng động lực<br />- elastic e. cân bằng đàn hồi<br />- indifferent e. cân bằng không phân biệt<br />- labile e. (vật lí) cân bằng không ổn định<br />- mobile e. (điều khiển học) cân bằng di động<br />- neutral e. (cơ học) cân bằng không phân biệt<br />- phase e. (vật lí) cân bằng pha<br />- plastic e. cân bằng dẻo<br />- relative e. cân bằng tương đối<br />- semi-stable e. cân bằng nửa ổn định<br />- stable e. cân bằng ổn định<br />- trasient e. (điều khiển học) cân bằng động<br />- unstable e. (vật lí) cân bằng không ổn định</Q></N></I></F></C>'),
(42687, 'Equilibrium aggregate output', '<C><F><I><N><Q>@Equilibrium aggregate output<br />- (Econ) Tổng sản lượng cân bằng.</Q></N></I></F></C>'),
(42688, 'Equilibrium error', '<C><F><I><N><Q>@Equilibrium error<br />- (Econ) Sai số cân bằng<br />+ Khi một nhóm các biến số được liên kết với nhau trong một mô hình HỒI QUY là đồng liên kết (xem COINTEGRATION)  thì thành phần nhiễu được gọi là sai số cân bằng.</Q></N></I></F></C>'),
(42689, 'Equilibrium level of national income', '<C><F><I><N><Q>@Equilibrium level of national income<br />- (Econ) Mức cân bằng của thu nhập quốc gia<br />+ Mức cân bằng của THU NHẬP QUỐC GIA không biểu hiện các xu hướng thay đổi.</Q></N></I></F></C>'),
(42690, 'equilibrium potential', '<C><F><I><N><Q>@equilibrium potential<br />- (Tech) thế cân bằng</Q></N></I></F></C>'),
(42691, 'Equilibrium price', '<C><F><I><N><Q>@Equilibrium price<br />- (Econ) Giá cân bằng<br />+ Giá tại đó THỊ TRƯỜNG ở trạng thái CÂN BẰNG.</Q></N></I></F></C>'),
(42692, 'Equilibrium rate of inflation', '<C><F><I><N><Q>@Equilibrium rate of inflation<br />- (Econ) Tỷ lệ lạm phát cân bằng.<br />+ Tỷ lệ LẠM PHÁT được hoàn toàn dự báo trước. TỶ lệ lạm phát giá cả mà tại đó các kỳ vọng có thể trở thành hiện thực.</Q></N></I></F></C>'),
(42693, 'equilibriums', '<C><F><I><N><Q>@Equilibrium<br />- (Econ) Cân bằng<br />+ Một cụm thuật ngữ mượn từ môn vật lý để miêu tả tình huống, trong đó các tác nhân kinh tế hay tổng tác nhân kinh tế như thị trường, không có động lực gì để thay đổi hành vi kinh tế của mình.</Q></N></I></F></C><C><F><I><N><Q>@equilibrium /,i:kwi''libriəm /<br />*  danh từ<br />- sự thăng bằng<br />- tính vô tư (trong nhận xét...)<br /><br />@equilibrium<br />- (Tech) cân bằng<br /><br />@equilibrium<br />- sự cân bằng<br />- e. of forces sự cân bằng lực<br />- e. of a particle [of a body] sự cân bằng của một vật thể<br />- configuration e. cấu hình thăng bằng<br />- dynamic e. cân bằng động lực<br />- elastic e. cân bằng đàn hồi<br />- indifferent e. cân bằng không phân biệt<br />- labile e. (vật lí) cân bằng không ổn định<br />- mobile e. (điều khiển học) cân bằng di động<br />- neutral e. (cơ học) cân bằng không phân biệt<br />- phase e. (vật lí) cân bằng pha<br />- plastic e. cân bằng dẻo<br />- relative e. cân bằng tương đối<br />- semi-stable e. cân bằng nửa ổn định<br />- stable e. cân bằng ổn định<br />- trasient e. (điều khiển học) cân bằng động<br />- unstable e. (vật lí) cân bằng không ổn định</Q></N></I></F></C>'),
(42694, 'Equilizing wage diffirentials', '<C><F><I><N><Q>@Equilizing wage diffirentials<br />- (Econ) Cân bằng các mức chênh lệch tiền công.</Q></N></I></F></C>'),
(42695, 'equimolecular', '<C><F><I><N><Q>@equimolecular /,i:kwimou''lekjulə/<br />*  tính từ<br />- đẳng phân tử</Q></N></I></F></C>'),
(42696, 'equimuliple', '<C><F><I><N><Q>@equimuliple<br />- cùng nhân tử, đồng nhân tử, các số đồng nhân tử</Q></N></I></F></C>'),
(42697, 'equimultiple', '<C><F><I><N><Q>@equimultiple /''i:kwi''mʌltipl/<br />*  danh từ,  (thường) số nhiều<br />- (toán học) số đẳng bội</Q></N></I></F></C>'),
(42698, 'equinaharmonic', '<C><F><I><N><Q>@equinaharmonic<br />- đẳng phi điều</Q></N></I></F></C>'),
(42699, 'equine', '<C><F><I><N><Q>@equine /i''kweiʃn/<br />*  tính từ<br />- (thuộc) ngựa; như ngựa; có tính chất ngựa</Q></N></I></F></C>'),
(42700, 'equinoctial', '<C><F><I><N><Q>@equinoctial /i''kweiʃn/<br />*  tính từ<br />- (thuộc) điểm phân<br />*  danh từ+ (equator) <br />/i''kweitə/<br />- đường phân (điểm)<br />- (số nhiều) bão xuân phân, bão thu phân<br /><br />@equinoctial<br />- (thuộc) phân điểm</Q></N></I></F></C>'),
(42701, 'equinox', '<C><F><I><N><Q>@equinox /''i:kwinɔks/<br />*  danh từ<br />- điểm phân<br />=vernal equinox+ xuân phân<br />=autumnal equinox+ thu phân<br />- (số nhiều) điểm xuân phân; điểm thu phân<br /><br />@equinox<br />- (thiên văn) phân điểm<br />- autummal e. thu phân <br />- vernal e. xuân phân</Q></N></I></F></C>'),
(42702, 'equinoxes', '<C><F><I><N><Q>@equinox /''i:kwinɔks/<br />*  danh từ<br />- điểm phân<br />=vernal equinox+ xuân phân<br />=autumnal equinox+ thu phân<br />- (số nhiều) điểm xuân phân; điểm thu phân<br /><br />@equinox<br />- (thiên văn) phân điểm<br />- autummal e. thu phân <br />- vernal e. xuân phân</Q></N></I></F></C>'),
(42703, 'equip', '<C><F><I><N><Q>@equip /i''kwip/<br />*  ngoại động từ<br />- trang bị (cho ai... cái gì)<br />=to equip an army with modren weapons+ trang bị vũ khí hiện đại cho một quân đội</Q></N></I></F></C>'),
(42704, 'equipage', '<C><F><I><N><Q>@equipage /''ekwipidʤ/<br />*  danh từ<br />- đồ dùng cần thiết (cho một cuộc đi...)<br />- cỗ xe (gồm cả xe, ngựa và người phục vụ)<br />- (từ cổ,nghĩa cổ) đoàn tuỳ tùng (đi theo quan to...)</Q></N></I></F></C>'),
(42705, 'equipages', '<C><F><I><N><Q>@equipage /''ekwipidʤ/<br />*  danh từ<br />- đồ dùng cần thiết (cho một cuộc đi...)<br />- cỗ xe (gồm cả xe, ngựa và người phục vụ)<br />- (từ cổ,nghĩa cổ) đoàn tuỳ tùng (đi theo quan to...)</Q></N></I></F></C>'),
(42706, 'equipartition', '<C><F><I><N><Q>@equipartition<br />* danh từ<br />- sự phân bố đều<br /><br />@equipartition<br />- phân hoạch đều</Q></N></I></F></C>'),
(42707, 'equiphase', '<C><F><I><N><Q>@equiphase<br />- (Tech) đẳng vị tướng</Q></N></I></F></C>'),
(42708, 'equipment', '<C><F><I><N><Q>@equipment /i''kwipmənt/<br />*  danh từ<br />- sự trang bị<br />- đồ trang bị, thiết bị, dụng cụ, đồ dùng cần thiết (cho một cuộc đi, cho một nhà máy...)<br />=electrical equipment+ thiết bị điện<br />=control equipment+ thiết bị điều khiển<br />- (từ Mỹ,nghĩa Mỹ) những phương tiện vận tải để phân biệt với các loại tài sản khác trong ngành vận tải)<br /><br />@equipment<br />- trang bị, dụng cụ, thiết bị, máy móc<br />- audio e. thiết bị âm thanh<br />- automatic control e. máy móc điều khiển tự động<br />- dislay e. máy báo hiệu<br />- electric e. trang bị điện<br />- industrial e. trang bị công nghiệp<br />- input e. thiết bị vào<br />- interconnecting e. thiết bị nối<br />- metering e. dụng cụ đo lường<br />- peripheral e. thiết bị ngoài<br />- production run e. trang bị sản xuất hàng loạt<br />- punched card e. (máy tính) thiết bị để đục lỗ bìa</Q></N></I></F></C>'),
(42709, 'equipments', '<C><F><I><N><Q>@equipment /i''kwipmənt/<br />*  danh từ<br />- sự trang bị<br />- đồ trang bị, thiết bị, dụng cụ, đồ dùng cần thiết (cho một cuộc đi, cho một nhà máy...)<br />=electrical equipment+ thiết bị điện<br />=control equipment+ thiết bị điều khiển<br />- (từ Mỹ,nghĩa Mỹ) những phương tiện vận tải để phân biệt với các loại tài sản khác trong ngành vận tải)<br /><br />@equipment<br />- trang bị, dụng cụ, thiết bị, máy móc<br />- audio e. thiết bị âm thanh<br />- automatic control e. máy móc điều khiển tự động<br />- dislay e. máy báo hiệu<br />- electric e. trang bị điện<br />- industrial e. trang bị công nghiệp<br />- input e. thiết bị vào<br />- interconnecting e. thiết bị nối<br />- metering e. dụng cụ đo lường<br />- peripheral e. thiết bị ngoài<br />- production run e. trang bị sản xuất hàng loạt<br />- punched card e. (máy tính) thiết bị để đục lỗ bìa</Q></N></I></F></C>'),
(42710, 'equipoise', '<C><F><I><N><Q>@equipoise /''ekwipɔiz/<br />*  danh từ<br />- (thường) (nghĩa bóng)<br />- sự thăng bằng, sự cân bằng<br />- trọng lượng cân bằng, đối trọng<br />*  ngoại động từ<br />- làm cân bằng<br />- làm đối trọng cho<br />- làm hồi hộp; làm thấp thỏm<br /><br />@equipoise<br />- sự cân bằng, vật cân bằng</Q></N></I></F></C>'),
