(42713, 'equipollence', '<C><F><I><N><Q>@equipollence /,i:kwi''pɔləns/ (equipollency) /,i:kwi''pɔlənsi/<br />*  danh từ<br />- sự bằng sức, sự ngang sức; sự tương đương (về giá trị...)</Q></N></I></F></C>'),
