(42722, 'equipotent', '<C><F><I><N><Q>@equipotent<br />* tính từ<br />- đẳng năng; đẳng thế<br />- toàn năng<br />- cân bằng thế năng<br />- (sinh học) có khả năng thực hiện chức năng của bộ phận khác (cơ quan, tế bào)<br /><br />@equipotent<br />- cùng lực lượng</Q></N></I></F></C>'),
