(42744, 'Equities', '<C><F><I><N><Q>@Equities<br />- (Econ) Cổ phần<br />+ Còn được gọi là cổ phiếu thường, là những cổ phiếu ở dạng vốn phát hành của một công ty.</Q></N></I></F></C>'),
(42745, 'equities', '<C><F><I><N><Q>@Equity<br />- (Econ) Công bằng<br />+ Công lý hay lẽ phải.<br /><br />@Equity<br />- (Econ) Vốn cổ phần.</Q></N></I></F></C><C><F><I><N><Q>@equity /''ekwiti/<br />*  danh từ<br />- tính công bằng, tính vô tư<br />- tính hợp tình hợp lý<br />- (từ Mỹ,nghĩa Mỹ) yêu sách hợp tình hợp lý; quyền lợi hợp tình hợp lý<br />- (từ Mỹ,nghĩa Mỹ) luật công lý (hệ thống luật pháp tồn tại song song và bổ sung cho luật thành văn)<br />- (Equity) công đoàn diễn viên<br />- (số nhiều) có phần không có lãi cố định<br />- giá trị tài sản bị cấm cố (sau khi trừ thuế má)</Q></N></I></F></C>'),
(42746, 'equitization', '<C><F><I><N><Q>@equitization<br />* danh từ<br />- sự cổ phần hoá<br />* danh từ<br />- sự cổ phần hoá</Q></N></I></F></C>'),
