(42749, 'equity', '<C><F><I><N><Q>@equity /''ekwiti/<br />*  danh từ<br />- tính công bằng, tính vô tư<br />- tính hợp tình hợp lý<br />- (từ Mỹ,nghĩa Mỹ) yêu sách hợp tình hợp lý; quyền lợi hợp tình hợp lý<br />- (từ Mỹ,nghĩa Mỹ) luật công lý (hệ thống luật pháp tồn tại song song và bổ sung cho luật thành văn)<br />- (Equity) công đoàn diễn viên<br />- (số nhiều) có phần không có lãi cố định<br />- giá trị tài sản bị cấm cố (sau khi trừ thuế má)</Q></N></I></F></C>'),
(42750, 'Equity capital', '<C><F><I><N><Q>@Equity capital<br />- (Econ) Vốn cổ phần<br />+ Xem EQUYTIES.</Q></N></I></F></C>'),
(42751, 'Equivalance scale', '<C><F><I><N><Q>@Equivalance scale<br />- (Econ) Thang/hệ số/ tỷ lệ/qui mô qui đổi mức sống tương đương; Quy mô tương đương.<br />+ Một hệ số hoặc một quyền số được dùng để đánh giá mức thu nhập hoặc tiêu dùng mà các gia đình bắt buộc phải có trong các hoàn cảnh khác nhau để đạt được một mức sống nhất định.</Q></N></I></F></C>'),
(42752, 'equivalence', '<C><F><I><N><Q>@equivalence /i''kwivələns/ (equivalency) /i''kwivələnsi/<br />*  danh từ<br />- tính tương đương; sự tương đương</Q></N></I></F></C>'),
(42753, 'equivalence, (cy)', '<C><F><I><N><Q>@equivalence, (cy)<br />- sự tương đương<br />- e. of propositions tương đương của các mệnh đề<br />- algebrai e. tương đương đại số <br />- analytic e. sự tương đương giải tích<br />- cardinal e. tương đương bản số<br />- natural e (đại số) tương đương tự nhiên<br />- topological e. tương đương tôpô</Q></N></I></F></C>'),
(42754, 'equivalence element', '<C><F><I><N><Q>@equivalence element<br />- (Tech) phần tử tương đương</Q></N></I></F></C>'),
