(43238, 'establish', '<C><F><I><N><Q>@establish /is''tæbliʃ/<br />*  ngoại động từ<br />- lập, thành lập, thiết lập, kiến lập<br />=to establish a government+ lập chính phủ<br />=to establish diplomatic relations+ kiến lập quan hệ ngoại giao<br />- đặt (ai vào một địa vị...)<br />- chứng minh, xác minh (sự kiện...)<br />- đem vào, đưa vào (thói quen, tín ngưỡng...)<br />- chính thức hoá (nhà thờ)<br />- củng cố, làm vững chắc<br />=to establish one''s reputation+ củng cố thanh danh<br />=to establish one''s health+ lấy lại sức khoẻ<br />=to establish oneself+ sinh cơ lập nghiệp; ổn định cuộc sống<br />=to establish oneself as a grocer+ sinh cơ lập nghiệp bằng nghề bán tạp phẩm<br /><br />@establish<br />- thiết lập</Q></N></I></F></C>'),
(43239, 'established', '<C><F><I><N><Q>@established /is''tæbliʃt/<br />*  tính từ<br />- đã thành lập, đã thiết lập<br />- đã được đặt (vào một địa vị)<br />- đã xác minh (sự kiện...)<br />- đã được đưa vào (thói quen, sự tín ngưỡng...)<br />- đã chính thức hoá (nhà thờ)<br />- đã định, đã chắc, được củng cố; đã thích nghi<br />- có uy tín</Q></N></I></F></C><C><F><I><N><Q>@establish /is''tæbliʃ/<br />*  ngoại động từ<br />- lập, thành lập, thiết lập, kiến lập<br />=to establish a government+ lập chính phủ<br />=to establish diplomatic relations+ kiến lập quan hệ ngoại giao<br />- đặt (ai vào một địa vị...)<br />- chứng minh, xác minh (sự kiện...)<br />- đem vào, đưa vào (thói quen, tín ngưỡng...)<br />- chính thức hoá (nhà thờ)<br />- củng cố, làm vững chắc<br />=to establish one''s reputation+ củng cố thanh danh<br />=to establish one''s health+ lấy lại sức khoẻ<br />=to establish oneself+ sinh cơ lập nghiệp; ổn định cuộc sống<br />=to establish oneself as a grocer+ sinh cơ lập nghiệp bằng nghề bán tạp phẩm<br /><br />@establish<br />- thiết lập</Q></N></I></F></C>'),
