(43254, 'Estate duty', '<C><F><I><N><Q>@Estate duty<br />- (Econ) Thuế di sản (thuế tài sản thừa kế).<br />+ Dạng chủ yếu của thuế của cải ở Anh trước khi nó được thay thế bằng thuế CHUYỂN GIAO VỐN năm 1974. Thuế này được dánh giá theo suất luỹ tiến vào các tài sản của người chủ khi người này qua đời. Thuế luỹ tiến  được áp dụng cho toàn bộ tài sản chứ không chỉ cho lượng gia tăng của cải.</Q></N></I></F></C>'),
(43255, 'Estate economy', '<C><F><I><N><Q>@Estate economy<br />- (Econ) Nền kinh tế đồn điền.<br />+ Thuật ngữ nói về một khu vực hay toàn bộ nền kinh tế ở một nước chậm phát triển được sử dụng để sản xuất đại quy mô lớn nông sản xuất khẩu, thường do các thế lực nước ngoài sở hữu hoặc quản lý; nền kinh tế này rất phổ biến trong thời kỳ thuộc địa.</Q></N></I></F></C>'),
(43256, 'estates', '<C><F><I><N><Q>@estate /is''teit/<br />*  danh từ<br />- tài sản, di sản<br />- bất động sản ruộng đất<br />- đẳng cấp<br />=the third estate+ đẳng cấp thứ ba (Pháp)<br />=fourth estate+(đùa cợt) giới báo chí<br />- (từ cổ,nghĩa cổ) hoàn cảnh, tình trạng<br /><br />@estate<br />- tài sản<br />- personal e. động sản <br />- real e. bất động sản</Q></N></I></F></C>'),
(43257, 'esteem', '<C><F><I><N><Q>@esteem /is''ti:m/<br />*  danh từ<br />- sự kính mến, sự quý trọng<br />=to hold someone in high esteem+ kính mến ai, quý trọng ai<br />*  ngoại động từ<br />- kính mến, quý trọng<br />- coi là, cho là<br />=to esteem it as a favour+ coi cái đó như là một đặc ân</Q></N></I></F></C>'),
