(43279, 'estimate', '<C><F><I><N><Q>@estimate /''estimit - ''estimeit/<br />- ''estimeit/<br />*  danh từ<br />- sự đánh giá, sự ước lượng<br />- số lượng ước đoán<br />- bản kê giá cả (thầu khoán)<br />!the Estimates<br />- dự thảo ngân sách<br />*  ngoại động từ<br />- đánh giá; ước lượng<br /><br />@estimate<br />- ước lượng, đánh giá<br />- e. of the number of zeros ước lượng số lượng các không điểm<br />- admissible e. ước lượng chấp nhận được<br />- combined ratio e ước lượng tổ hợp dưới dạng trung bình<br />- consistent e. (thống kê) ước lượng vững<br />- grand-lot e. ước lượng theo những lô lớn<br />- invariant e. (thống kê) ước lượng bất biến<br />- minimax e.(thống kê) ước lượng minimac<br />- ordered e. (thống kê) ước lượng nhờ thống kê thứ tự<br />- overall e. ước lượng đầy đủ<br />- regression e. ước lượng hồi quy<br />- unbiased e. ước lượng không chệch<br />- upper e. (giải tích) ước lượng trên</Q></N></I></F></C>'),
