(43282, 'estimating', '<C><F><I><N><Q>@estimate /''estimit - ''estimeit/<br />- ''estimeit/<br />*  danh từ<br />- sự đánh giá, sự ước lượng<br />- số lượng ước đoán<br />- bản kê giá cả (thầu khoán)<br />!the Estimates<br />- dự thảo ngân sách<br />*  ngoại động từ<br />- đánh giá; ước lượng<br /><br />@estimate<br />- ước lượng, đánh giá<br />- e. of the number of zeros ước lượng số lượng các không điểm<br />- admissible e. ước lượng chấp nhận được<br />- combined ratio e ước lượng tổ hợp dưới dạng trung bình<br />- consistent e. (thống kê) ước lượng vững<br />- grand-lot e. ước lượng theo những lô lớn<br />- invariant e. (thống kê) ước lượng bất biến<br />- minimax e.(thống kê) ước lượng minimac<br />- ordered e. (thống kê) ước lượng nhờ thống kê thứ tự<br />- overall e. ước lượng đầy đủ<br />- regression e. ước lượng hồi quy<br />- unbiased e. ước lượng không chệch<br />- upper e. (giải tích) ước lượng trên</Q></N></I></F></C>'),
(43283, 'Estimation', '<C><F><I><N><Q>@Estimation<br />- (Econ) Sự ước lượng.<br />+ Sự xác định mang tính định lượng các tham số trong các mô hình kinh tế thông qua các số liệu thông kê.</Q></N></I></F></C>'),
(43284, 'estimation', '<C><F><I><N><Q>@estimation /,esti''meiʃn/<br />*  danh từ<br />- sự đánh giá; sự ước lượng<br />- sự kính mến, sự quý trọng<br />=to hold someone in estimation+ kính mến ai, quý trọng ai<br /><br />@estimation<br />- (Tech) ước lượng, ước tính<br /><br />@estimation<br />- ước lượng, sự đánh giá<br />- e. of error sự đánh giá sai số<br />- e. of the order sư đánh giá bậc (sai số)<br />- efficiency e. (thống kê) sự ước lượng hữu hiệu<br />- error e. sự đánh giá sai số<br />- interval e. (thống kê) sự ước lượng khoảng<br />- point e. (toán kinh tế) sự ước lượng điểm<br />- sequetial e. sự ước lượng liên tiếp<br />- simultaneous e.(thống kê) sự ước lượng đồng thời</Q></N></I></F></C>'),
(43285, 'estimations', '<C><F><I><N><Q>@Estimation<br />- (Econ) Sự ước lượng.<br />+ Sự xác định mang tính định lượng các tham số trong các mô hình kinh tế thông qua các số liệu thông kê.</Q></N></I></F></C><C><F><I><N><Q>@estimation /,esti''meiʃn/<br />*  danh từ<br />- sự đánh giá; sự ước lượng<br />- sự kính mến, sự quý trọng<br />=to hold someone in estimation+ kính mến ai, quý trọng ai<br /><br />@estimation<br />- (Tech) ước lượng, ước tính<br /><br />@estimation<br />- ước lượng, sự đánh giá<br />- e. of error sự đánh giá sai số<br />- e. of the order sư đánh giá bậc (sai số)<br />- efficiency e. (thống kê) sự ước lượng hữu hiệu<br />- error e. sự đánh giá sai số<br />- interval e. (thống kê) sự ước lượng khoảng<br />- point e. (toán kinh tế) sự ước lượng điểm<br />- sequetial e. sự ước lượng liên tiếp<br />- simultaneous e.(thống kê) sự ước lượng đồng thời</Q></N></I></F></C>'),
(43286, 'estimative', '<C><F><I><N><Q>@estimative /''estimətiv/<br />*  tính từ<br />- để đánh giá; để ước lượng</Q></N></I></F></C>'),
(43287, 'Estimator', '<C><F><I><N><Q>@Estimator<br />- (Econ) Phương thức ước lượng; Ước lượng.<br />+ Một công thức hay một quy trình ước lượng các con số thống kê (chẳng hạn như TRUNG BÌNH hay PHƯƠNG SAI của một biến số) hoặc các tham số của một phương trình nhân được từ số liệu.</Q></N></I></F></C>'),
(43288, 'estimator', '<C><F><I><N><Q>@estimator /''estimetiə/<br />*  danh từ<br />- người đánh giá; người ước lượng<br /><br />@estimator<br />- công thức ước lượng, (thống kê) ước lượng<br />- absolutely unbiased e. ước lượng không tuyệt đối <br />- best e. ước lượng tốt nhất<br />- biased e. ước lượng chệch<br />- efficient e. ước lượng hữu hiệu<br />- inconsistent e. ước lượng không vững<br />- least-quares e. ước lượng bình phương bé nhất<br />- linear e. ước lượng tuyến tính<br />- most-efficient e. ước lượng hữu hiệu nhất<br />- non-regular e. ước lượng không chính quy<br />- quadraitic e. ước lượng bậc hai<br />- ratio e. ước lượng dưới dạng tỷ số<br />- regular e. ước lượng chính quy<br />- unbiased e. ước lượng không chệch <br />- uniformly best constant risk e. (UBCR) ước lượng có độ mạo hiểm bé<br />- đều nhất</Q></N></I></F></C>'),
