(43619, 'Eurocurrency market', '<C><F><I><N><Q>@Eurocurrency market<br />- (Econ) Thị trường tiền tệ Châu ÂU.<br />+ Một thị trường quốc tế ở nước ngoài của các đồng tiền của các nước công nghiệp lớn (phương Tây).</Q></N></I></F></C>'),
(43620, 'eurodollar', '<C><F><I><N><Q>@eurodollar<br />* danh từ<br />- đô la Âu châu</Q></N></I></F></C>'),
(43621, 'Eurodollars', '<C><F><I><N><Q>@Eurodollars<br />- (Econ) Đola Châu Âu.<br />+ Xem EUROCURRENCY MARKET.</Q></N></I></F></C>'),
(43622, 'eurodollars', '<C><F><I><N><Q>@eurodollar<br />* danh từ<br />- đô la Âu châu</Q></N></I></F></C>'),
(43623, 'europe', '<C><F><I><N><Q>@europe<br />* danh từ<br />- (địa lý) châu Âu</Q></N></I></F></C>'),
(43624, 'european', '<C><F><I><N><Q>@european /,juərə''pi:ən/<br />*  tính từ<br />- (thuộc) Châu âu; ở Châu âu, tại Châu âu; lan khắp Châu âu<br />=a european reputation+ tiếng tăm lan khắp Châu âu<br />*  danh từ<br />- người Châu âu</Q></N></I></F></C>'),
(43625, 'European Agricultural Guidance and Guaranted Fund', '<C><F><I><N><Q>@European Agricultural Guidance and Guaranted Fund<br />- (Econ) Quỹ Bảo đảm và Hướng dãn Nông nghiệp Châu Âu.<br />+ Một quỹ đặc biệt của CỘNG ĐỒNG CHÂU ÂU được thành lập năm 1962 nhằm tài trợ vốn cho chính sách nông nghiệp chung của cộng đồng.</Q></N></I></F></C>'),
(43626, 'European Bank for Reconstruction and Development', '<C><F><I><N><Q>@European Bank for Reconstruction and Development<br />- (Econ) Ngân hàng tái thiết và Phát triển Châu ÂU.<br />+ Được thành lập năm 1991 với số vốn 10 tỷ đơn vị tiền tệ Châu Âu nhằm thúc đẩy sự phát triển ở các nước thuộc khối Đông Âu.</Q></N></I></F></C>'),
(43627, 'European Coal and Steel Community', '<C><F><I><N><Q>@European Coal and Steel Community<br />- (Econ) Cộng đồng Than và thép Châu Âu.<br />+ Tổ chức thực hiện và quản lý THỊ TRƯỜNG CHUNG về than &amp; thép giữa 6 nước thành viên sáng lập của CỘNG ĐỒNG CHÂU ÂU.</Q></N></I></F></C>'),
(43628, 'European Commom Market', '<C><F><I><N><Q>@European Commom Market<br />- (Econ) Thị trường chung Châu Âu.<br />+ Xem European Economic Community.</Q></N></I></F></C>'),
(43629, 'European Community', '<C><F><I><N><Q>@European Community<br />- (Econ) Cộng đồng Châu Âu.<br />+ Một tên gọi chung của 3 tổ chức: Cộng đồng Than và thép Châu Âu, Cộng đồng kinh tế châu Âu và cộng đồng năng lượng nguyên tử Châu Âu.</Q></N></I></F></C>'),
(43630, 'European Community Budget', '<C><F><I><N><Q>@European Community Budget<br />- (Econ) Ngân sách Cộng đồng Châu Âu.<br />+ Một ngân sách do các nước thành viên của cộng đồng Châu Âu đóng góp nhằm tài trợ cho các hoạt động của cộng đồng. Các khoản đóng góp từ các thành viên ở dạng 90% là doanh thu từ thuế NÔNG NGHIỆP và BIỂU THUẾ QUAN CHUNG và dưới 1% doanh thu từ thuế GIÁ TRỊ GIA TĂNG được tính cho mực đích làm hài hoà thuế giữa các nước thành viên.</Q></N></I></F></C>'),
(43631, 'European Currency Unit', '<C><F><I><N><Q>@European Currency Unit<br />- (Econ) Đơn vị tiền tệ Châu Âu.<br />+ Xem EUROPEAN MONETARY SYSTEM.</Q></N></I></F></C>'),
(43632, 'European Devolopment Fund', '<C><F><I><N><Q>@European Devolopment Fund<br />- (Econ) Quỹ phát triển Châu Âu.<br />+ Một quỹ đặc biệt do CỘNG ĐỒNG KINH TẾ CHÂU ÂU thành lập để cung cấp viện trợ tài chính và kỹ thuật cho các nước liên kết với Cộng đồng Châu Âu theo Hiệp Ứơc ROME, các hiệp định YAOUNDÉ và LOMÉ. Xem EUROPEAN INVESTMENT BANK.</Q></N></I></F></C>'),
(43633, 'European Economic Community', '<C><F><I><N><Q>@European Economic Community<br />- (Econ) Cộng đồng Kinh tế Châu Âu.<br />+ Cộng đồng Kinh tế Châu Âu được cínhthwcs thành lập ngày 25-3-1957 theo hiệp ước Rome do chính phủ các nước Bỉ, Hà Lan, Cộng hoà liên bang Đức, Italia, Lucxămbua. Hiệp ước này đưa lại sự phát triển tự do liên minh thuế quan, loại bỏ mọi rào cản đối với sự vận động tự do của VỐN, LAO ĐỘNG và DỊCH VỤ và hình thành các chính sách vận tải và nông nghiệp giữa các nước thành viên.</Q></N></I></F></C>'),
(43634, 'European Free Trade Association', '<C><F><I><N><Q>@European Free Trade Association<br />- (Econ) Hiệp hội Mậu dịch tự do Châu Âu.<br />+ Được thành lập năm 1960 sau Hiệp định Stockholm, được Áo, Đan mạch, Nauy. Bồ Đào Nha, Thuỵ Điển, Thuỵ Sĩ, Anh thông qua. Hiệp hội đạt được các mục tiêu ban đầu của mình là thiết lập buôn bán hàng hoá công nghiệp tự do giữa các mục tiêu ban đầu của mình là thiết lập buôn bán hàng hoá công nghiệp tự do giữa các thành viên và đàm phán một hiệp ước thương mại toàn diện với cộng đồng châu Âu (EC).</Q></N></I></F></C>'),
(43635, 'European Fund', '<C><F><I><N><Q>@European Fund<br />- (Econ) Quỹ Châu Âu.<br />+ HIỆP ƯỚC TIỀN TỆ CHÂU ÂU được hội đồng OEEC thông qua vào năm 1955, cho phép quỹ Châu Âu giúp tài trợ thâm hụt CÁN CÂN THANH TOÁN tạm thời phát sinh từ quyết định của các nước thành viên làm cho đồng tiền của mình có khả năng chuyển đổi với đồng Đôla.</Q></N></I></F></C>'),
(43636, 'European Investment Bank', '<C><F><I><N><Q>@European Investment Bank<br />- (Econ) Ngân hàng Đầu tư Châu Âu.<br />+ Một ngân hàng phát triển được thành lập năm 1957 theo HIỆP ƯỚC ROME, cho ra đời CỘNG ĐÔNG KINH TẾ CHÂU ÂU. Chức năng cơ bản của ngân hàng này là thúc đẩy sự phát triển của hị trường chung Châu Âu bằng cách cấp cấp các khoản vay dài hạn, bảo lãnh các khoản vay tạo điều kiện tài trợ đầu tư cho các vùng kém phát triển, các kế hoạch hiện đại hoá công nghiệp và các dự án công nghiệp.</Q></N></I></F></C>'),
(43637, 'European Monetary Agreement', '<C><F><I><N><Q>@European Monetary Agreement<br />- (Econ) Hiệp định tiền tệ Châu Âu.<br />+ Hiệp định được Hội đồng TỔ CHỨC HỢP TÁC KINH TẾ CHÂU ÂU thông qua năm 1955. Hiệp định là quyết định của các nước Châu Âu nhằm làm cho đồng tiền của các nước dần dần chuyển đổi được đối với đồng đôla, bằng cách đó thay thế LIÊN MINH THANH TOÁN CHÂU ÂU bằng một hệ thống thanh toán quốc tế mới, trong đó mọi giao dịch phải được tiến hành bằng vàng hoặc các đồng tiền có thể chuyển đổi.</Q></N></I></F></C>'),
(43638, 'European Monetary Co-operation Fund', '<C><F><I><N><Q>@European Monetary Co-operation Fund<br />- (Econ) Quỹ hợp tác Tiền tệ Châu ÂU.<br />+ Một quỹ đặc biệt của EC hình thành năm 1973 nhằm áp dụng HIỆP ĐỊNH BASLE 1972, hiệp định này quy định các mức dao động trong trao đổi của các đồng tiền được quản lý, đựoc biết đến như con rắn tiền tệ châu Âu.</Q></N></I></F></C>'),
(43639, 'European Monetary Fund', '<C><F><I><N><Q>@European Monetary Fund<br />- (Econ) Quỹ Tiền tệ Châu ÂU.<br />+ Xem EUROPEAN MONETARY FUND.</Q></N></I></F></C>'),
(43640, 'European Monetary System (EMS)', '<C><F><I><N><Q>@European Monetary System (EMS)<br />- (Econ) Hệ thống tiền tệ châu Âu.<br />+ Được áp dụng vào tháng 3-1979, hệ thống này (EMS) là một nỗ lực nhằm tạo nên một khu vực ổn định về tỷ giá hối đoái giữa các nước thành viên, vì hầu hết các thành viên đều tiến hành việc hạn chế biến động tỷ giá hối đoái của mình ở mức (+) hoặc (-) 2,25% giá trung tâm, đã thống nhất cho đồng tiền của họ.</Q></N></I></F></C>'),
(43641, 'European Monetary Unit of Account', '<C><F><I><N><Q>@European Monetary Unit of Account<br />- (Econ) Đơn vị Kế toán Tiền tệ Châu Âu.<br />+ Xem EUROPEAN UNIT OF ACCOUNT.</Q></N></I></F></C>'),
(43642, 'European Payments Union', '<C><F><I><N><Q>@European Payments Union<br />- (Econ) Liên minh Thanh toán Châu Âu.<br />+ Năm 1950, TỔ CHỨC HỢP TÁC KINH TẾ CHÂU ÂU thành lập Liên minh Thanh toán Châu Âu, thay thế cho hệ thống các tổ chức thanh toán Châu Âu do các hiệp định thanh toán trong Châu Âu năm 1948 và năm 1949 đưa vào áp dụng. Mục đích của liên minh này tạo điều kiện choa thanh toán thặng dư hay thâm hụt đa phương giữa các nước Châu Âu (và các khu vực tiền tệ ở nước ngoài tương ứng của chúng) và khuyến khích các chính sách tự do hoá mậu dịch bằng cách đưa ra các phương tịên tín dụng tự động cho các thành viên gặp phải thâm hụt cán cân thanh toán.</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(43643, 'European Recovery Programme.', '<C><F><I><N><Q>@European Recovery Programme.<br />- (Econ) Chương trình Phục hưng Châu Âu.<br />+ Năm 1947, Bộ trưởng ngoại giao MỸ, tướng George Marshall đã phát biểu trong một bài diễn văn tại trường Đại học Harvard, đề nghị giúp đỡ của Mỹ đối với chương trình phục hồi nền kinh tế Châu Âu do các nước Châu Âu điều phối. Sau bài diễn văn này, các đại diện của 16 nước Tây Âu đã thành lập Uỷ ban về Hợp tác Kinh tế Châu Âu, TỔ CHỨC HỢP TÁC KINH TẾ CHÂU ÂU được thành lập năm 1948 để điều hành một chương trình phục hưng châu Âu cùng với UỶ BAN HỢP TÁC KINH TẾ CỦA MỸ. Chương trình này thường được gọi là VIỆN TRỢ MARSHALL.</Q></N></I></F></C>'),
(43644, 'European Regional Development Fund.', '<C><F><I><N><Q>@European Regional Development Fund.<br />- (Econ) Quỹ Phát triển Khu vực Châu Âu.<br />+ Một quỹ đặc biệt của CỘNG ĐỒNG CHÂU ÂU, thành lập năm 1975, nhằm làm giảm sự chênh lệch về phát triển kinh tế giữa các khu vực trong cộng đồng.</Q></N></I></F></C>'),
(43645, 'European Social Fund.', '<C><F><I><N><Q>@European Social Fund.<br />- (Econ) Quỹ Xã hội Châu ÂU.<br />+ Một quỹ đặc biệt của CỘNG ĐỒNG CHÂU ÂU, nhằm mục đích tăng cường cơ hội tìm kiếm việc làm trong cộng đồng bằng cách đảm bảo hỗ trợ tài chính để đào tạo lại công nhân, đặc biệt là những ai bị thu hẹp công việc do hoạt động của Thị trường chung Châu Âu.</Q></N></I></F></C>'),
(43646, 'European Unit of Account', '<C><F><I><N><Q>@European Unit of Account<br />- (Econ) Đơn vị Kế toán Châu Âu.<br />+ Là đơn vị kế toán được sử dụng trong CỘNG ĐỒNG CHÂU ÂU cho các mục đích như chuẩn bị ngân sách công đồng và định giá sản phẩm nông nghiệp thông qua CHÍNH SÁCH NÔNG NGHIỆP CHUNG. Vì các nước thành viện của ÉCử dụng các đồng tiền khác nhau, nên cần thiết phải tạo ra một đơn vị kế toán chung để trao đổi buôn bán công đồng.</Q></N></I></F></C>'),
(43647, 'europeanise', '<C><F><I><N><Q>@europeanise /,juərə''pi:ənaiz/ (Europeanise) /,juərə''pi:ənaiz/<br />*  ngoại động từ<br />- âu hoá</Q></N></I></F></C>'),
(43648, 'europeanism', '<C><F><I><N><Q>@europeanism /,juərə''pi:ənizm/<br />*  danh từ<br />- chủ nghĩa Châu âu</Q></N></I></F></C>'),
(43649, 'europeanization', '<C><F><I><N><Q>@europeanization /''juərə,pi:ənai''zeiʃn/<br />*  danh từ<br />- sự âu hoá</Q></N></I></F></C>'),
(43650, 'europeanize', '<C><F><I><N><Q>@europeanize /,juərə''pi:ənaiz/ (Europeanise) /,juərə''pi:ənaiz/<br />*  ngoại động từ<br />- âu hoá</Q></N></I></F></C>'),
(43651, 'Europeans', '<C><F><I><N><Q>@european /,juərə''pi:ən/<br />*  tính từ<br />- (thuộc) Châu âu; ở Châu âu, tại Châu âu; lan khắp Châu âu<br />=a european reputation+ tiếng tăm lan khắp Châu âu<br />*  danh từ<br />- người Châu âu</Q></N></I></F></C>'),
(43652, 'europium', '<C><F><I><N><Q>@europium /ju:''roupiəm/<br />*  danh từ<br />- (hoá học) Europi</Q></N></I></F></C>'),
(43653, 'Eurostat', '<C><F><I><N><Q>@Eurostat<br />- (Econ) Cục Thống kê của CÔNG ĐỒNG CHÂU ÂU.</Q></N></I></F></C>'),
(43654, 'eurovision', '<C><F><I><N><Q>@eurovision /,juərou''viʤn/<br />*  danh từ<br />- truyền hình cho toàn Châu âu</Q></N></I></F></C>'),
(43655, 'eurus', '<C><F><I><N><Q>@eurus<br />* danh từ<br />- thần gió đông, gió đông nam (thần thoại Hy-lạp)<br />- gió đông; gió đông nam</Q></N></I></F></C>'),
(43656, 'eurythmic', '<C><F><I><N><Q>@eurythmic<br />* tính từ<br />- xem eurhythmic</Q></N></I></F></C>'),
(43657, 'eurythmics', '<C><F><I><N><Q>@eurythmics<br />* danh từ<br />- xem eurhythmy</Q></N></I></F></C>'),
(43658, 'eurythmy', '<C><F><I><N><Q>@eurythmy<br />* danh từ<br />- xem eurhythmy</Q></N></I></F></C>'),
(43659, 'eusol', '<C><F><I><N><Q>@eusol /''ju:sɔl/<br />*  danh từ<br />- (viết tắt) của Edinburgh Univerity solution<br />- (hoá học) nước khử trùng vôi clorua</Q></N></I></F></C>'),
(43660, 'eustachian tube', '<C><F><I><N><Q>@eustachian tube /ju:s''teiʃjən''tju:b/<br />*  danh từ<br />- (giải phẫu) vòi Ot-tát</Q></N></I></F></C>'),
(43661, 'eustatic', '<C><F><I><N><Q>@eustatic<br />* tính từ<br />- (địa chất) chấn tĩnh</Q></N></I></F></C>'),
(43662, 'eusternum', '<C><F><I><N><Q>@eusternum<br />* danh từ<br />- mảnh ức côn trùng</Q></N></I></F></C>'),
(43663, 'eustomatous', '<C><F><I><N><Q>@eustomatous<br />* tính từ<br />- (động vật) có miệng chính thức</Q></N></I></F></C>'),
(43664, 'eusystole', '<C><F><I><N><Q>@eusystole<br />* danh từ<br />- tâm thu bình thường</Q></N></I></F></C>'),
(43665, 'eutectic', '<C><F><I><N><Q>@eutectic /ju:''tektik/<br />*  tính từ<br />- (hoá học) Eutecti<br />=eutectic temperature (point)+ điểm Eutecti<br />*  danh từ<br />- (hoá học) Eutecti</Q></N></I></F></C>'),
(43666, 'eutectics', '<C><F><I><N><Q>@eutectic /ju:''tektik/<br />*  tính từ<br />- (hoá học) Eutecti<br />=eutectic temperature (point)+ điểm Eutecti<br />*  danh từ<br />- (hoá học) Eutecti</Q></N></I></F></C>'),
(43667, 'eutectoid', '<C><F><I><N><Q>@eutectoid<br />* tính từ<br />- ơtectoi; cùng tích</Q></N></I></F></C>'),
(43668, 'euterpean', '<C><F><I><N><Q>@euterpean<br />* tính từ<br />- thuộc nữ thần âm nhạc<br />- thuộc âm nhạc</Q></N></I></F></C>'),
(43669, 'euthanasia', '<C><F><I><N><Q>@euthanasia /,ju:θə''neizjə/<br />*  danh từ<br />- sự chết không đau đớn<br />- sự làm chết không đau đớn</Q></N></I></F></C>'),
(43670, 'euthenics', '<C><F><I><N><Q>@euthenics<br />* danh từ<br />- khoa cải tiến điều kiện sinh sống</Q></N></I></F></C>'),
(43671, 'euthenist', '<C><F><I><N><Q>@euthenist<br />* danh từ<br />- người theo khoa cải tiến điều kiện sinh sống</Q></N></I></F></C>'),
(43672, 'eutheria', '<C><F><I><N><Q>@eutheria /ju:''θi:əriə/<br />*  danh từ số nhiều<br />- (động vật học) lớp phụ thú có nhau</Q></N></I></F></C>'),
(43673, 'eutherian', '<C><F><I><N><Q>@eutherian<br />* danh từ<br />- động vật có vú chính thức; động vật có nhau<br />* tính từ<br />- thuộc động vật có vú chính thức, động vật có nhau</Q></N></I></F></C>'),
(43674, 'euthyroid', '<C><F><I><N><Q>@euthyroid<br />* tính từ<br />- có tuyến giáp bình thường</Q></N></I></F></C>'),
(43675, 'eutrophic', '<C><F><I><N><Q>@eutrophic<br />* tính từ<br />- dinh dưỡng tốt</Q></N></I></F></C>'),
