(43797, 'event', '<C><F><I><N><Q>@event /i''vent/<br />*  danh từ<br />- sự việc, sự kiện<br />- sự kiện quan trọng<br />- (thể dục,thể thao) cuộc đấu, cuộc thi<br />- trường hợp, khả năng có thể xảy ra<br />=in the event of success+ trong trường hợp thành công<br />=at all events; in any event+ trong bất kỳ trường hợp nào<br />- kết quả, hậu quả<br /><br />@event<br />- (Tech) sự biến<br /><br />@event<br />- sự kiện; (xác suất) ; (thống kê) biến cố<br />- antithetic(al) e.s (thống kê) biến cố xung khắc<br />- certain e. [sự kiện, biến cố] chắc chắn<br />- compatible e.s (thống kê) các biến cố tương thích <br />- complementary e. biến cố đối lập<br />- dependent e. biến cố phụ thuộc<br />- equal e.s các biến cố bằng nhau <br />- exhaustive e.s nhóm đầy đủ các biến cố<br />- favourable e. biến cố thuận lợi<br />- imposible e. (xác suất) biến cố không thể<br />- incompatible e.s (xác suất) các biến cố không tương thích<br />- independent e. (xác suất) biến cố độc lập<br />- mutually exclusive e.s các biến cố xung khắc<br />- null e. biến cố có xác suất không<br />- random e. (thống kê) biến cố ngẫu nhiên<br />- simple e. biến cố sơ cấp</Q></N></I></F></C>'),
(43798, 'event-driven', '<C><F><I><N><Q>@event-driven<br />- (Tech) dựa theo sự biến</Q></N></I></F></C>'),
(43799, 'event handler', '<C><F><I><N><Q>@event handler<br />- (Tech) thủ trình cho sự biến</Q></N></I></F></C>'),
(43800, 'event interrupt', '<C><F><I><N><Q>@event interrupt<br />- (Tech) ngắt cho sự biến</Q></N></I></F></C>'),
(43801, 'eventful', '<C><F><I><N><Q>@eventful /i''ventful/<br />*  tính từ<br />- có nhiều sự kiện quan trọng<br />=an eventful year+ một năm có nhiều sự kiện quan trọng<br />- có kết quả quan trọng<br />=an eventful conversation+ một cuộc nói chuyện có kết quả quan trọng</Q></N></I></F></C>'),
(43802, 'eventfully', '<C><F><I><N><Q>@eventfully<br />- xem eventful</Q></N></I></F></C>'),
(43803, 'eventfulness', '<C><F><I><N><Q>@eventfulness<br />- xem eventful</Q></N></I></F></C>'),
(43804, 'eventide', '<C><F><I><N><Q>@eventide /''i:vəntaid/<br />*  danh từ<br />- (thơ ca) chiều hôm</Q></N></I></F></C>'),
(43805, 'eventing', '<C><F><I><N><Q>@eventing<br />* danh từ<br />- môn thể thao có dùng ngựa</Q></N></I></F></C>'),
(43806, 'eventless', '<C><F><I><N><Q>@eventless<br />- xem event</Q></N></I></F></C>'),
(43807, 'eventration', '<C><F><I><N><Q>@eventration<br />* danh từ<br />- (y học) sự lồi phủ tạng</Q></N></I></F></C>'),
(43808, 'eventrations', '<C><F><I><N><Q>@eventration<br />* danh từ<br />- (y học) sự lồi phủ tạng</Q></N></I></F></C>'),
(43809, 'events', '<C><F><I><N><Q>@event /i''vent/<br />*  danh từ<br />- sự việc, sự kiện<br />- sự kiện quan trọng<br />- (thể dục,thể thao) cuộc đấu, cuộc thi<br />- trường hợp, khả năng có thể xảy ra<br />=in the event of success+ trong trường hợp thành công<br />=at all events; in any event+ trong bất kỳ trường hợp nào<br />- kết quả, hậu quả<br /><br />@event<br />- (Tech) sự biến<br /><br />@event<br />- sự kiện; (xác suất) ; (thống kê) biến cố<br />- antithetic(al) e.s (thống kê) biến cố xung khắc<br />- certain e. [sự kiện, biến cố] chắc chắn<br />- compatible e.s (thống kê) các biến cố tương thích <br />- complementary e. biến cố đối lập<br />- dependent e. biến cố phụ thuộc<br />- equal e.s các biến cố bằng nhau <br />- exhaustive e.s nhóm đầy đủ các biến cố<br />- favourable e. biến cố thuận lợi<br />- imposible e. (xác suất) biến cố không thể<br />- incompatible e.s (xác suất) các biến cố không tương thích<br />- independent e. (xác suất) biến cố độc lập<br />- mutually exclusive e.s các biến cố xung khắc<br />- null e. biến cố có xác suất không<br />- random e. (thống kê) biến cố ngẫu nhiên<br />- simple e. biến cố sơ cấp</Q></N></I></F></C>'),
(43810, 'eventual', '<C><F><I><N><Q>@eventual /i''ventjuəl/<br />*  tính từ<br />- ngộ xảy ra, có thể xảy ra<br />- sẽ được dẫn tới, là kết quả của; cuối cùng<br />=blunders leading to eventual disaster+ những sai lầm dẫn đến sự tai hoạ cuối cùng<br /><br />@eventual<br />- có thể, có thể xảy ra, sẽ xảy ra</Q></N></I></F></C>'),
(43811, 'eventualities', '<C><F><I><N><Q>@eventuality /i,ventju''æliti/<br />*  danh từ<br />- sự việc có thể xảy ra; kết quả có thể xảy ra, tình huống có thể xảy ra<br />=to be ready for any eventualities+ phải sẵn sàng trước mọi tình huống có thể xảy ra</Q></N></I></F></C>'),
(43812, 'eventuality', '<C><F><I><N><Q>@eventuality /i,ventju''æliti/<br />*  danh từ<br />- sự việc có thể xảy ra; kết quả có thể xảy ra, tình huống có thể xảy ra<br />=to be ready for any eventualities+ phải sẵn sàng trước mọi tình huống có thể xảy ra</Q></N></I></F></C>'),
(43813, 'eventually', '<C><F><I><N><Q>@eventually /i''ventjuəli/<br />*  phó từ<br />- cuối cùng<br /><br />@eventually<br />- cuối cùng, tính cho cùng</Q></N></I></F></C>'),
(43814, 'eventuate', '<C><F><I><N><Q>@eventuate /i''ventjueit/<br />*  nội động từ<br />- hoá ra là, thành ra là<br />=to eventuate well+ hoá ra là tốt<br />=to eventuate ill+ hoá ra là xấu<br />- ((thường) + in) kết thúc; đưa đến kết quả là<br />- (từ Mỹ,nghĩa Mỹ) xảy ra</Q></N></I></F></C>'),
(43815, 'eventuated', '<C><F><I><N><Q>@eventuate /i''ventjueit/<br />*  nội động từ<br />- hoá ra là, thành ra là<br />=to eventuate well+ hoá ra là tốt<br />=to eventuate ill+ hoá ra là xấu<br />- ((thường) + in) kết thúc; đưa đến kết quả là<br />- (từ Mỹ,nghĩa Mỹ) xảy ra</Q></N></I></F></C>'),
(43816, 'eventuates', '<C><F><I><N><Q>@eventuate /i''ventjueit/<br />*  nội động từ<br />- hoá ra là, thành ra là<br />=to eventuate well+ hoá ra là tốt<br />=to eventuate ill+ hoá ra là xấu<br />- ((thường) + in) kết thúc; đưa đến kết quả là<br />- (từ Mỹ,nghĩa Mỹ) xảy ra</Q></N></I></F></C>'),
(43817, 'eventuating', '<C><F><I><N><Q>@eventuate /i''ventjueit/<br />*  nội động từ<br />- hoá ra là, thành ra là<br />=to eventuate well+ hoá ra là tốt<br />=to eventuate ill+ hoá ra là xấu<br />- ((thường) + in) kết thúc; đưa đến kết quả là<br />- (từ Mỹ,nghĩa Mỹ) xảy ra</Q></N></I></F></C>'),
(43818, 'ever', '<C><F><I><N><Q>@ever /''evə/<br />*  phó từ<br />- bao giờ; từ trước đến giờ; hàng, từng<br />=more than ever+ hơn bao giờ hết<br />=the best story ever heard+ chuyện hay nhất đã từng được nghe<br />=the greatest thinker ever+ nhà tư tưởng lớn nhất từ trước đến giờ<br />- luôn luôn, mãi mãi<br />=to live for ever+ sống mãi<br />- (thông tục) nhỉ<br />=what ever does he wants?+ nó muốn cái gì thế nhỉ?<br />=who ever can it be?+ ai thế nhỉ?<br />!did you ever?<br />- có bao giờ anh (nghe chuyện như thế, thấy chuyện như thế) chưa?<br />- thế không?<br />!ever had anon<br />- (xem) anon<br />!ever after<br />!ever since<br />- suốt từ đó, mãi mãi từ đó<br />!ever so<br />- (thông tục) rất là, thật là, lắm, hết sức<br />=to be ever so happy+ thật là hạnh phúc<br />=thank you ever so much+ cảm ơn anh lắm, hết sức cảm ơn anh<br />!for ever<br />!for ever and ever<br />- mãi mãi<br />!yours ever<br />- bạn thân của anh (công thức cuối thư)</Q></N></I></F></C>'),
(43819, 'ever-bearing', '<C><F><I><N><Q>@ever-bearing<br />* tính từ<br />- (thực vật) ra quả quanh năm</Q></N></I></F></C>'),
(43820, 'ever-blooming', '<C><F><I><N><Q>@ever-blooming<br />* tính từ<br />- (thực vật) ra hoa quanh năm</Q></N></I></F></C>'),
(43821, 'ever-changing', '<C><F><I><N><Q>@ever-changing<br />* tính từ<br />- bấp bênh (người); thay đổi luôn</Q></N></I></F></C>'),
(43822, 'ever-greeness', '<C><F><I><N><Q>@ever-greeness<br />* danh từ<br />- tính thường xanh (cây)<br />- tính bất hủ</Q></N></I></F></C>'),
(43823, 'everglade', '<C><F><I><N><Q>@everglade /''evəgleid/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) đầm lầy</Q></N></I></F></C>'),
(43824, 'everglades', '<C><F><I><N><Q>@everglade /''evəgleid/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) đầm lầy</Q></N></I></F></C>'),
(43825, 'evergreen', '<C><F><I><N><Q>@evergreen /''evəgri:n/<br />*  danh từ<br />- (thực vật học) cây thương xanh<br />- (số nhiều) cây xanh trang trí</Q></N></I></F></C>'),
(43826, 'evergreens', '<C><F><I><N><Q>@evergreen /''evəgri:n/<br />*  danh từ<br />- (thực vật học) cây thương xanh<br />- (số nhiều) cây xanh trang trí</Q></N></I></F></C>'),
(43827, 'everlasting', '<C><F><I><N><Q>@everlasting /,evə''lɑ:stiɳ/<br />*  tính từ<br />- vĩnh viễn, mãi mãi, đời đời, bất diệt<br />- kéo dài mãi, láy đi láy lại mãi, không ngớt, không ngừng, không dứt<br />=this everlasting noise+ tiếng ầm ầm không bao giờ dứt<br />- (thực vật học) giữ nguyên dạng và màu khi khô<br />!the Everlasting<br />- Chúa,  Thượng đế<br />*  danh từ<br />- thời gian vô tận, ngàn xưa<br />=the monument has been there since everlasting+ công trình đó có từ ngàn xưa<br />- (thực vật học) cây cúc trường sinh<br />- vải chéo len</Q></N></I></F></C>'),
(43828, 'everlastingly', '<C><F><I><N><Q>@everlastingly<br />* phó từ<br />- liên miên, không ngớt</Q></N></I></F></C>'),
(43829, 'everlastingness', '<C><F><I><N><Q>@everlastingness /,evə''lɑ:stiɳnis/<br />*  danh từ<br />- tính vĩnh viễn, tính lâu dài, tính bất diệt<br />- sự kéo dài mãi, sự láy đi láy lại mãi, sự không ngớt, sự không ngừng, sự không dứt</Q></N></I></F></C>'),
(43830, 'everliving', '<C><F><I><N><Q>@everliving /,evə''liviɳ/<br />*  tính từ<br />- tồn tại vĩnh viễn, bất diệt</Q></N></I></F></C>'),
(43831, 'evermore', '<C><F><I><N><Q>@evermore /,evə''mɔ:/<br />*  phó từ<br />- mãi mãi, đời đời</Q></N></I></F></C>'),
(43832, 'eversible', '<C><F><I><N><Q>@eversible /i''və:sibl/<br />*  tính từ<br />- có thể lộn trong ra ngoài</Q></N></I></F></C>'),
(43833, 'eversion', '<C><F><I><N><Q>@eversion /i''və:ʃn/<br />*  danh từ<br />- (số nhiều) sự lộn ra<br />- (từ cổ,nghĩa cổ) sự lật đổ</Q></N></I></F></C>'),
(43834, 'eversions', '<C><F><I><N><Q>@eversion /i''və:ʃn/<br />*  danh từ<br />- (số nhiều) sự lộn ra<br />- (từ cổ,nghĩa cổ) sự lật đổ</Q></N></I></F></C>'),
(43835, 'evert', '<C><F><I><N><Q>@evert /i''və:t/<br />*  ngoại động từ<br />- (sinh vật học) lộn ra, lộn trong ra ngoài<br />- (từ cổ,nghĩa cổ) lật đổ</Q></N></I></F></C>'),
(43836, 'every', '<C><F><I><N><Q>@every /''evri/<br />*  tính từ<br />- mỗi, mọi<br />!every man Jack<br />- mọi người<br />!every now and then; every now and again; every so often<br />- thỉnh thoảng<br />!every other day; every second day<br />- hai ngày một lần<br /><br />@every<br />- mỗi, mọi</Q></N></I></F></C>'),
(43837, 'every time', '<C><F><I><N><Q>@every time /''evritaim/<br />*  phó từ<br />- lần nào cũng<br />=our football team wins every_time+ đội bóng của ta lần nào cũng thắng</Q></N></I></F></C>'),
(43838, 'every way', '<C><F><I><N><Q>@every way /''evriwei/<br />*  phó từ<br />- về mọi mặt, về mọi phương diện</Q></N></I></F></C>');
